INSERT INTO `mdl_cache_text` (`id`, `md5key`, `formattedtext`, `timemodified`) VALUES
(1, 'd48213ebae6a59118c30822c0a3b49db', '<div class="no-overflow"><h1><span style="color: rgb(51, 51, 51); line-height: 14px;"><font face="arial, helvetica, sans-serif" size="2">ALIANZA SANTA TERESA</font></span></h1><h1><span style="color: rgb(51, 51, 51); line-height: 14px;"><font face="arial, helvetica, sans-serif" size="2">Somos un grupo de personas interesadas en la Evangelización del cristianismo católico.</font></span></h1><h2><span style="color: rgb(51, 51, 51); line-height: 14px;"><font face="arial, helvetica, sans-serif" size="2">Para mayores informes:</font></span></h2><p><span style="color: rgb(51, 51, 51); line-height: 14px;"><font face="arial, helvetica, sans-serif" size="2"><b>Email</b>: </font></span><span style="color: rgb(6, 33, 52); font-family: arial, ''ｍｓ ｐゴシック'', ''ms pgothic'', 돋움, dotum, helvetica, sans-serif; line-height: 19.200000762939453px;"> ast.tijuana@gmail.com</span></p><div><span style="color: rgb(51, 51, 51); line-height: 14px;"><font face="arial, helvetica, sans-serif" size="2"><b>Website: </b></font></span><font color="#333333" face="arial, helvetica, sans-serif" size="2"><span style="line-height: 14px;"><b>http://www.asttijuana.org/</b></span></font></div><div><span style="color: rgb(51, 51, 51); line-height: 14px;"><font face="arial, helvetica, sans-serif" size="2"><b>Facebook</b>: Alianza Santa Teresa,</font></span></div><div><span style="color: rgb(51, 51, 51); line-height: 14px;"><font face="arial, helvetica, sans-serif" size="2">                 Grupo Domus Christi<br /></font></span></div></div>', 1408526858),
(2, '5dc64df52072d9fbf9516906dba3039f', '<h1><span style="color:rgb(51,51,51);line-height:14px;"><font face="arial, helvetica, sans-serif" size="2">ALIANZA SANTA TERESA</font></span></h1><h1><span style="color:rgb(51,51,51);line-height:14px;"><font face="arial, helvetica, sans-serif" size="2">Somos un grupo de personas interesadas en la Evangelización del cristianismo católico.</font></span></h1><h2><span style="color:rgb(51,51,51);line-height:14px;"><font face="arial, helvetica, sans-serif" size="2">Para mayores informes:</font></span></h2><p><span style="color:rgb(51,51,51);line-height:14px;"><font face="arial, helvetica, sans-serif" size="2"><b>Email</b>: </font></span><span style="color:rgb(6,33,52);font-family:arial, ''ｍｓ ｐゴシック'', ''ms pgothic'', ''돋움'', dotum, helvetica, sans-serif;line-height:19.200000762939453px;"> ast.tijuana@gmail.com</span></p><div><span style="color:rgb(51,51,51);line-height:14px;"><font face="arial, helvetica, sans-serif" size="2"><b>Website: </b></font></span><font color="#333333" face="arial, helvetica, sans-serif" size="2"><span style="line-height:14px;"><b>http://www.asttijuana.org/</b></span></font></div><div><span style="color:rgb(51,51,51);line-height:14px;"><font face="arial, helvetica, sans-serif" size="2"><b>Facebook</b>: Alianza Santa Teresa,</font></span></div><div><span style="color:rgb(51,51,51);line-height:14px;"><font face="arial, helvetica, sans-serif" size="2">                 Grupo Domus Christi<br /></font></span></div>', 1408526858),
(3, '65c51c371e90520969992d6c661249eb', '<div class="no-overflow"><p style="text-align: right;"><span style="line-height: 115%;"><font face="arial, helvetica, sans-serif" size="3">El diplomado en Ciencia y Religión<br />\r\naspira a ofrecer a los alumnos una visión sistémica del misterio de la<br />\r\nsalvación, junto con el conocimiento específico de las materias filosóficas,<br />\r\npsicológicas, bioéticas y teológicas para afrontar dicho diálogo<br />\r\ninterdisciplinar.</font></span></p><p style="text-align: right;"><span style="line-height: 115%;"><font face="arial, helvetica, sans-serif" size="3"><a href="http://www.asttijuana.org/#!diplomado/ckyp" target="_blank">Breve descripción aquí</a></font></span></p></div>', 1408526858),
(4, '71776e36ded02b5fe0a722f7ad526a36', '<div class="no-overflow">Este curso te dará una introducción al estudio del cristianismo católico.<br />\r\n<br />\r\n<br />\r\n<br />\r\n</div>', 1408526858),
(5, '542752490d917af400300ee055f7f384', '<div class="no-overflow">Analizaremos el nacimiento de las tradiciones que recogen los evangelios, su transmisión en las comunidades primitivas, hasta su puesta por escrito definitiva tal como ha llegado a nosotros.<br />\r\n</div>', 1408526858),
(6, '4ea3f1dfd48c520169439c15c869c2cd', '<div class="no-overflow">Vocación. <a href="http://ec.aciprensa.com/wiki/Vocaci%C3%B3n#.U4brTfkbWmI" target="_blank">Breve descripción aquí</a></div>', 1408526858),
(7, 'ed54f8fd331f0c3854606aa852bc7de4', '<div class="no-overflow">Este curso tiene lecciones de italiano básicas, intermedias y avanzadas.<br />\r\n<br />\r\n</div>', 1408526858),
(8, 'fd7db274d86795ef55e1f56b829a1fa8', '<div class="no-overflow">Para consultar precios del curso, escríbeme:<div><div style="text-align: justify;">Contacto:</div><div style="text-align: justify;">Mtra. María Alma Fragoso</div><div style="text-align: justify;">website: </div><div style="text-align: justify;"><a href="http://languagelc.wix.com/llc#!contact">http://languagelc.wix.com/llc#!contact</a></div><div style="text-align: justify;">skype: llctijuana</div><div style="text-align: justify;">Tel: 664 809 1478</div><div style="text-align: justify;">email: llctijuana@gmail.com</div></div></div>', 1408526858),
(9, '673e3a8980d2d82a14c2cccdb24b1113', '<div class="no-overflow"><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">El </span><b style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">árabe</b><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">, también llamado </span><b style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">arábigo</b><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">,</span><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;"> </span><b style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">arabía</b><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">,</span><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;"> o </span><b style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">algarabía</b><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">,</span><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;"> (en árabe: العربية</span><i style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">al-ʻarabīyah</i><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;"> o عربي/عربى </span><i style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">ʻarabī</i><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">, pronunciación: </span><a href="https://es.wikipedia.org/wiki/Alfabeto_fon%C3%A9tico_internacional" title="Alfabeto fonético internacional" class="mw-redirect" style="text-decoration: none; color: rgb(11, 0, 128); background-image: none; font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">[alʕaraˈbijja]</a><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;"> o </span><a href="https://es.wikipedia.org/wiki/Alfabeto_fon%C3%A9tico_inte