(13, 'dbe348054096fa2034f9a1589f1db709', '<div class="no-overflow"><p style="text-align: right;"><span style="line-height: 115%;"><font face="arial, helvetica, sans-serif" size="3">El diplomado en Ciencia y Religión<br />\r\naspira a ofrecer a los alumnos una visión sistémica del misterio de la<br />\r\nsalvación, junto con el conocimiento específico de las materias filosóficas,<br />\r\npsicológicas, bioéticas y teológicas para afrontar dicho diálogo<br />\r\ninterdisciplinar.</font></span></p><p style="text-align: right;"><span style="line-height: 115%;"><font face="arial, helvetica, sans-serif" size="3"><a href="http://www.asttijuana.org/#!diplomado/ckyp" target="_blank">Breve descripción aquí</a></font></span></p></div>', 1408526182),
