INSERT INTO `mdl_chat` (`id`, `course`, `name`, `intro`, `introformat`, `keepdays`, `studentlogs`, `chattime`, `schedule`, `timemodified`) VALUES
(1, 5, 'Clase de Fenomenología de la Religión', '<div>Estimados alumnos:</div><div>  Para las tutorías es necesario que descarguen el programa ooVoo que es gratuito y que permite conferenciar hasta 12 personas (video y voz simultáneamente), para el servicio de tutorías vía internet.</div><div>Lo pueden descargar gratuitamente aquí:</div><div>http://www.oovoo.com/home.aspx</div><div>Cuando hagan el &quot;sign in&quot;, haganme llegar a mi email su cuenta de ooVoo gratuita y a través de mi email recibirán indicaciones para los horarios de tutorías disponibles. Las evaluaciones serán publicadas el fin de semana para cada curso semanal por lo que sí les recomiendo que hagan las evaluaciones seleccionando el Examen de cada semana y para contabilizar automáticamente sus promedios semanalmente. </div><div>Sí les recomiendo que hagan sus propios esquemas y les facilitaré el archivo word del texto visto por si desean modificarlo para sus apuntes personales.</div><div>Pueden postear sus propios esquemas en su News Forum seleccionando &quot;Add new topic&quot; y así servirle a otros estudiantes.</div><div>Para más dudas pueden escribirme a sergioattijuana@gmail.com y les contestaré durante el fin de semana para ver cómo avanzaron en sus lecturas y evaluaciones. </div> <br />\n', 1, 0, 1, 1376778600, 0, 1376778587),
(2, 5, 'Para chatear sobre las dudas al curso', 'Pueden aclarar sus dudas a través de este chat.', 1, 0, 0, 1377273600, 0, 1377217191);
