INSERT INTO `mdl_course` (`id`, `category`, `sortorder`, `fullname`, `shortname`, `idnumber`, `summary`, `summaryformat`, `format`, `showgrades`, `modinfo`, `newsitems`, `startdate`, `numsections`, `marker`, `maxbytes`, `legacyfiles`, `showreports`, `visible`, `visibleold`, `hiddensections`, `groupmode`, `groupmodeforce`, `defaultgroupingid`, `lang`, `theme`, `timecreated`, `timemodified`, `requested`, `restrictmodules`, `enablecompletion`, `completionnotify`, `completionstartonenrol`) VALUES
(1, 0, 1, 'Ciencia y Fe Tijuana', 'cienciayfe', '', '<h1><span style="color: rgb(51, 51, 51); line-height: 14px;"><font face="arial, helvetica, sans-serif" size="2">ALIANZA SANTA TERESA</font></span></h1><h1><span style="color: rgb(51, 51, 51); line-height: 14px;"><font face="arial, helvetica, sans-serif" size="2">Somos un grupo de personas interesadas en la Evangelización del cristianismo católico.</font></span></h1><h2><span style="color: rgb(51, 51, 51); line-height: 14px;"><font face="arial, helvetica, sans-serif" size="2">Para mayores informes:</font></span></h2><p><span style="color: rgb(51, 51, 51); line-height: 14px;"><font face="arial, helvetica, sans-serif" size="2"><b>Email</b>: </font></span><span style="color: rgb(6, 33, 52); font-family: arial, ''ｍｓ ｐゴシック'', ''ms pgothic'', 돋움, dotum, helvetica, sans-serif; line-height: 19.200000762939453px;"> ast.tijuana@gmail.com</span></p><div><span style="color: rgb(51, 51, 51); line-height: 14px;"><font face="arial, helvetica, sans-serif" size="2"><b>Website: </b></font></span><font color="#333333" face="arial, helvetica, sans-serif" size="2"><span style="line-height: 14px;"><b>http://www.asttijuana.org/</b></span></font></div><div><span style="color: rgb(51, 51, 51); line-height: 14px;"><font face="arial, helvetica, sans-serif" size="2"><b>Facebook</b>: Alianza Santa Teresa,</font></span></div><div><span style="color: rgb(51, 51, 51); line-height: 14px;"><font face="arial, helvetica, sans-serif" size="2">                 Grupo Domus Christi<br /></font></span></div>', 1, 'site', 1, 'a:0:{}', 3, 0, 0, 0, 0, 2, 0, 1, 1, 0, 0, 0, 0, '', '', 0, 1392454582, 0, 0, 0, 0, 0),
(2, 1, 10010, 'Guitar 101', 'G101', '', 'Vengan a aprender a tocar la guitarra con el maestro Francisco Castañeda.<br />\r\n<br />\r\n<br />\r\n<br />\r\n', 1, 'weeks', 1, NULL, 5, 1375592400, 3, 0, 67108864, 2, 0, 1, 1, 0, 2, 0, 0, '', '', 1369680437, 1375954669, 0, 0, 0, 0, 0),
(3, 1, 10002, 'Historia de la Iglesia Católica', 'HI101', 'HI101', 'Este curso te dará una introducción al estudio del cristianismo católico.<br />\r\n<br />\r\n<br />\r\n<br />\r\n', 1, 'topics', 0, NULL, 5, 1370667600, 4, 0, 67108864, 2, 0, 1, 1, 0, 2, 0, 0, '', '', 1370647399, 1401350613, 0, 0, 0, 0, 0),
(4, 1, 10009, 'Arabe', 'Arabe básico', 'A100', '<span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">El </span><b style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">árabe</b><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">, también llamado </span><b style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">arábigo</b><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">,</span><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;"> </span><b style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">arabía</b><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">,</span><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;"> o </span><b style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">algarabía</b><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">,</span><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;"> (en árabe: العربية</span><i style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">al-ʻarabīyah</i><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;"> o عربي/عربى </span><i style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">ʻarabī</i><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">, pronunciación: </span><a href="https://es.wikipedia.org/wiki/Alfabeto_fon%C3%A9tico_internacional" title="Alfabeto fonético internacional" class="mw-redirect" style="text-decoration: none; color: rgb(11, 0, 128); background-image: none; font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">[alʕaraˈbijja]</a><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;"> o </span><a href="https://es.wikipedia.org/wiki/Alfabeto_fon%C3%A9tico_internacional" title="Alfabeto fonético internacional" class="mw-redirect" style="text-decoration: none; color: rgb(11, 0, 128); background-image: none; font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">[ˈʕarabiː]</a><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">) es una </span><a href="https://es.wikipedia.org/wiki/Macrolengua" title="Macrolengua" style="text-decoration: none; color: rgb(11, 0, 128); background-image: none; font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">macrolengua</a><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;"> de la </span><a href="https://es.wikipedia.org/wiki/Lenguas_sem%C3%ADticas" title="Lenguas semíticas" style="text-decoration: none; color: rgb(11, 0, 128); background-image: none; font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">familia semítica</a><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">, como el </span><a href="https://es.wikipedia.org/wiki/Idioma_arameo" title="Idioma arameo" class="mw-redirect" style="text-decoration: none; color: rgb(11, 0, 128); background-image: none; font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">arameo</a><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">, el </span><a href="https://es.wikipedia.org/wiki/Idioma_hebreo" title="Idioma hebreo" style="text-decoration: none; color: rgb(11, 0, 128); background-image: none; font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">hebreo</a><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">, el </span><a href="https://es.wikipedia.org/wiki/Idioma_acadio" title="Idioma acadio" style="text-decoration: none; color: rgb(11, 0, 128); background-image: none; font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">acadio</a><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">, el</span><a href="https://es.wikipedia.org/wiki/Idioma_malt%C3%A9s" title="Idioma maltés" style="text-decoration: none; color: rgb(11, 0, 128); background-image: none; font-family: sans-serif; font-size: 13px; line-height: 19.1875px;">maltés</a><span style="font-family: sans-serif; font-size: 13px; line-height: 19.1875px;"> y otras lenguas similares.</span>', 1, 'weeks', 1, NULL, 5, 1374555600, 30, 0, 67108864, 2, 0, 1, 1, 1, 0, 0, 0, '', '', 1371944973, 1375492216, 0, 0, 0, 0, 0),
(5, 1, 10001, 'Diplomado en Ciencia y Fe', 'CF101', 'CF101', '<p style="text-align: right;"><span style="line-height: 115%;"><font face="arial, helvetica, sans-serif" size="3">El diplomado en Ciencia y Religión<br />\r\naspira a ofrecer a los alumnos una visión sistémica del misterio de la<br />\r\nsalvación, junto con el conocimiento específico de las materias filosóficas,<br />\r\npsicológicas, bioéticas y teológicas para afrontar dicho diálogo<br />\r\ninterdisciplinar.</font></span></p><p style="text-align: right;"><span style="line-height: 115%;"><font face="arial, helvetica, sans-serif" size="3"><a href="http://www.asttijuana.org/#!diplomado/ckyp" target="_blank">Breve descripción aquí</a></font></span></p>', 1, 'topics', 1, NULL, 5, 1375592400, 10, 0, 67108864, 2, 0, 1, 1, 0, 1, 1, 0, '', '', 1375494823, 1401351824, 0, 0, 0, 0, 0),
(6, 1, 10005, 'Italian IT101', 'IT101', '', 'Este curso tiene lecciones de italiano básicas, intermedias y avanzadas.<br />\r\n<br />\r\n', 1, 'topics', 1, NULL, 5, 1376456400, 3, 0, 67108864, 2, 1, 1, 1, 0, 0, 0, 0, '', '', 1376421377, 1392015915, 0, 0, 0, 0, 0),
(7, 1, 10008, 'Inglés IN101', 'IN101', '', 'Para consultar precios del curso, escríbeme:<div><div style="text-align: justify;">Contacto:</div><div style="text-align: justify;">Mtra. María Alma Fragoso</div><div style="text-align: justify;">website: </div><div style="text-align: justify;"><a href="http://languagelc.wix.com/llc#!contact">http://languagelc.wix.com/llc#!contact</a></div><div style="text-align: justify;">skype: llctijuana</div><div style="text-align: justify;">Tel: 664 809 1478</div><div style="text-align: justify;">email: llctijuana@gmail.com</div></div>', 1, 'weeks', 1, NULL, 5, 1376456400, 2, 0, 67108864, 2, 0, 1, 1, 0, 0, 0, 0, '', '', 1376441794, 1379380566, 0, 0, 0, 0, 0),
(8, 1, 10007, 'Deutsch Kurs101', 'DK 101', '', '', 1, 'topics', 1, NULL, 5, 1379048400, 10, 0, 67108864, 2, 0, 1, 1, 0, 0, 0, 0, '', '', 1379024111, 1379380167, 0, 0, 0, 0, 0),
(9, 1, 10006, 'cours de français 101', 'FR101', '', '', 1, 'topics', 1, NULL, 5, 1379048400, 10, 0, 67108864, 2, 0, 1, 1, 0, 0, 0, 0, '', '', 1379026002, 1379380092, 0, 0, 0, 0, 0),
(10, 1, 10003, 'Evangelios Sinópticos', 'ES101', 'ES101', 'Analizaremos el nacimiento de las tradiciones que recogen los evangelios, su transmisión en las comunidades primitivas, hasta su puesta por escrito definitiva tal como ha llegado a nosotros.<br />\r\n', 1, 'weeks', 1, NULL, 5, 1379912400, 5, 0, 67108864, 2, 0, 1, 1, 0, 0, 0, 0, '', '', 1380251807, 1380251856, 0, 0, 0, 0, 0),
(11, 1, 10004, 'Pastoral Vocacional', 'PV100', '', 'Vocación. <a href="http://ec.aciprensa.com/wiki/Vocaci%C3%B3n#.U4brTfkbWmI" target="_blank">Breve descripción aquí</a>', 1, 'topics', 1, NULL, 5, 1391839200, 10, 0, 67108864, 2, 0, 1, 1, 0, 0, 0, 0, '', '', 1391816221, 1401351731, 0, 0, 0, 0, 0);
