(1, 'Examen Fenomenología de la Religión', '', 1, 5, 0, 3, 0, '', 0, 'course', 1376730000, 244200, 1, '', 1, 1376178651),
(13, 'Para chatear sobre las dudas al curso', 'Pueden aclarar sus dudas a través de este chat.', 0, 5, 0, 0, 0, 'chat', 2, '0', 1377273600, 0, 1, '', 1, 1377217191),
(19, 'Examen de Fenomenología de la Religión (Quiz opens)', '', 0, 5, 0, 0, 0, 'quiz', 2, 'open', 1376553600, 0, 1, '', 1, 1404593272),
(9, 'Clase de Fenomenología de la Religión', '<div>Estimados alumnos:</div><div>  Para las tutorías es necesario que descarguen el programa ooVoo que es gratuito y que permite conferenciar hasta 12 personas (video y voz simultáneamente), para el servicio de tutorías vía internet.</div><div>Lo pueden descargar gratuitamente aquí:</div><div>http://www.oovoo.com/home.aspx</div><div>Cuando hagan el &quot;sign in&quot;, haganme llegar a mi email su cuenta de ooVoo gratuita y a través de mi email recibirán indicaciones para los horarios de tutorías disponibles. Las evaluaciones serán publicadas el fin de semana para cada curso semanal por lo que sí les recomiendo que hagan las evaluaciones seleccionando el Examen de cada semana y para contabilizar automáticamente sus promedios semanalmente. </div><div>Sí les recomiendo que hagan sus propios esquemas y les facilitaré el archivo word del texto visto por si desean modificarlo para sus apuntes personales.</div><div>Pueden postear sus propios esquemas en su News Forum seleccionando &quot;Add new topic&quot; y así servirle a otros estudiantes.</div><div>Para más dudas pueden escribirme a sergioattijuana@gmail.com y les contestaré durante el fin de semana para ver cómo avanzaron en sus lecturas y evaluaciones. </div>\r\n', 0, 5, 0, 0, 0, 'chat', 1, '0', 1376778600, 0, 1, '', 1, 1376778587),
(20, 'Examen de Historia de las Religiones (Quiz opens)', '', 0, 5, 0, 0, 0, 'quiz', 3, 'open', 1377389100, 0, 1, '', 1, 1404593302),
(21, 'Examen de Teología Fundamental (Quiz opens)', '', 0, 5, 0, 0, 0, 'quiz', 5, 'open', 1378014300, 0, 1, '', 1, 1404593325),
(22, 'Examen de Moral Fundamental (Quiz opens)', '', 0, 5, 0, 0, 0, 'quiz', 6, 'open', 1379257500, 0, 1, '', 1, 1404593345),
(18, 'Exámen sobre los evangelios sinópticos (Quiz opens)', '', 0, 10, 0, 0, 0, 'quiz', 8, 'open', 1380167100, 0, 1, '', 1, 1380308337);
