(1, 1, 0, 3, 1370793735, 1370793735, 0, 'Los primero 6 siglos del Cristianismo Católico', '<div data-configid="3842813/3203242" style="width: 525px; height: 525px;" class="issuuembed"></div><script type="text/javascript" src="http://e.issuu.com/embed.js" async="true"></script>', 1, 0, '', 0, 0),
(3, 3, 0, 3, 1376437811, 1376438060, 0, 'Storia della lingua italiana', '<div>L''italiano  è una lingua romanza, basata sul fiorentino letterario usato nel Trecento, appartenente al gruppo italico della famiglia delle lingue indoeuropee.</div><div>L''italiano modello è oggi ampiamente usato dalla popolazione italiana, in parallelo alle varianti regionali dell''italiano, alle lingue regionali e ai dialetti, e per molti italiani è sia la lingua materna sia la lingua per tutti gli scambi della vita quotidiana. L''italiano modello è inoltre la lingua di riferimento per i mezzi di comunicazione italiani, per l''editoria e per l''amministrazione dello Stato.</div><div>L''italiano è una delle ventiquattro lingue ufficiali dell''Unione europea ed è lingua ufficiale dell''Italia, di San Marino, della Svizzera, della Città del Vaticano e del Sovrano Militare Ordine di Malta.</div><div>È seconda lingua ufficiale, dopo il croato, nella Regione Istriana (Croazia) e, dopo lo sloveno, nelle città di Pirano, Isola d''Istria e Capodistria in Slovenia. È la seconda lingua più parlata nel Principato di Monaco e parimenti in Albania; è inoltre diffuso in alcune aree dei paesi mediterranei, nelle ex-colonie e nelle comunità di origine italiana nei diversi continenti.</div><div><br /></div><div>L''italiano è una lingua neolatina, cioè derivata dal latino volgare parlato in Italia nell''antichità romana e profondamente trasformatosi nel corso dei secoli.</div><div>L''italiano moderno ha come base il fiorentino letterario usato nel Trecento da Dante, Petrarca e Boccaccio, a sua volta influenzato dal volgare siciliano illustre elaborato dalla Scuola siciliana di Jacopo da Lentini (1230-1250) e dal modello latino.</div><div><br /></div><div>Dal latino volgare ai volgari italiani</div><div><br /></div><div><br /></div><div>Pensare all''italiano come a una filiazione diretta dal latino può risultare semplicistico e approssimativo: l''italiano è di fatto la stessa &quot;lingua parlata&quot; dei Romani, che attraverso una lunga evoluzione, è diventata l''italiano odierno. In altre parole, già in epoca classica esisteva un latino &quot;volgare&quot;, pervenutoci attraverso testi non letterari, graffiti, iscrizioni non ufficiali o testi letterari attenti a riprodurre la lingua parlata, come accade spesso nella commedia.</div><div>Esisteva poi un latino &quot;letterario&quot;, quello adottato dagli scrittori classici e legato alla lingua scritta, ma anche alla lingua parlata dai ceti socialmente più rilevanti e più colti.</div><div>A partire dal III secolo d.C., il Cristianesimo introdusse nella lingua latina nuovi significati e nuove esigenze pratiche. Queste nuove prospettive significarono anche un deciso passo verso l''incontro di lingua parlata e lingua scritta: autori come Ambrogio, Girolamo e Agostino adottarono nei loro scritti la lingua del popolo, la lingua di uso quotidiano, introducendo così, e con maggiore forza che in passato, altri elementi dialettali.</div><div>Con la caduta dell''Impero romano e la formazione dei regni romano-barbarici, si assiste a una sorta di sclerotizzazione del latino scritto (che diviene lingua amministrativa e scolastica), mentre il latino parlato si fonde sempre più intimamente con i dialetti dei popoli latinizzati, dando vita alle lingue neolatine, tra cui l''italiano.</div><div>Gli storici della lingua etichettano le parlate che si svilupparono in questo modo in Italia durante il Medioevo come volgari italiani, al plurale, e non ancora lingua italiana. Le testimonianze disponibili mostrano infatti marcate differenze tra le parlate delle diverse zone mentre manca un comune modello volgare di riferimento.</div><div>Il primo documento di uso di un volgare italiano è invece un placito notarile, conservato nell''abbazia di Montecassino, proveniente dal principato longobardo di Capua e risalente al 960: è il Placito cassinese (detto anche Placito di Capua o &quot;Placito capuano&quot;), che in sostanza è una testimonianza giurata di un abitante circa una lite sui confini di proprietà tra il monastero benedettino di Capua afferente ai Benedettini dell''abbazia di Montecassino e un piccolo feudo vicino, il quale aveva ingiustamente occupato una parte del territorio dell''abbazia: Sao ko kelle terre per kelle fini que ki contene trenta anni le possette parte Sancti Benedicti. È una frase soltanto, che tuttavia per svariati motivi può essere considerata ormai volgare e non più latina: i casi (salvo il genitivo Sancti Benedicti, che riprende la dizione del latino ecclesiastico) sono scomparsi, sono presenti la congiunzione ko (&quot;che&quot;) e il dimostrativo kelle (&quot;quelle&quot;), morfologicamente il verbo sao (dal latino sapio) è prossimo alla forma italiana ecc. Questo documento è seguito a brevissima distanza da altri placiti provenienti dalla stessa area geografico-linguistica, come il Placito di Sessa Aurunca e il Placito di Teano.</div><div>Uno dei primi casi di diffusione sovraregionale della lingua è la poesia della scuola siciliana, scritta verosimilmente in volgare siciliano da numerosi poeti (non tutti siciliani) attivi prima della metà del Duecento nell''ambiente della corte imperiale. Alcuni tratti linguistici con questa origine vennero adottati anche dagli scrittori toscani delle generazioni successive e si sono mantenuti per secoli nella lingua poetica italiana: dalle forme monottongate come core e loco ai condizionali in -ia (saria per sarebbe).</div>\r\n', 1, 0, '', 0, 0),
(4, 4, 0, 3, 1376454213, 1376457035, 0, 'Mtra. María Alma Fragoso', '<img src="https://mail-attachment.googleusercontent.com/attachment/u/0/?ui=2&ik=a72cf27d2c&view=att&th=1407b3b03cf46c53&attid=0.1&disp=inline&realattid=f_hkc2yjpp0&safe=1&zw&saduie=AG9B_P9SfgxaPexBiC7ownO9bxAc&sadet=1376457035549&sads=IXWvCY5OgUMUKmlkVdPive8LDqY" alt="Foto Mary en LCM" title="Foto Mary en LCM" border="0" hspace="0" vspace="0" /><div><br /></div><div style="text-align: justify;"><br /></div><div style="text-align: justify;">La Mtra. Fragoso, con una licenciatura en Literatura de la Universidad de California San Diego UCSD, ha formado parte de proyectos de investigación relacionados con la educación,  comunicación y tecnología. Su experiencia incluye la formación de UCSD universitarios de alto nivel que utilizan enfoques con énfasis en la aplicación de la teoría a la práctica a través de la experiencia de campo. Ella ha entrenado y ha guiado a grupos universitarios de UCSD en programas de asistencia educativa bilingüe y bicultural para niños hispanos. Sus otras habilidades incluyen la supervisión de actividades para niños, evaluación de actividades educativas de estudiantes universitarios y llevar notas de campo de su rendimiento, así como facilitar recursos pedagógicos para estudiantes de postgrado. Con una formación educativa en literatura español e inglés, estamos orgullosos de ofrecer su experiencia para aquellos que buscan mejorar sus capacidades en estos idiomas.</div><div style="text-align: justify;"><br /></div><div style="text-align: justify;">Contacto:</div><div style="text-align: justify;">website: <a href="http://languagelc.wix.com/llc#!contact">http://languagelc.wix.com/llc#!contact</a></div><div style="text-align: justify;">skype: llctijuana</div><div style="text-align: justify;">Tel: 664 809 1478</div><div style="text-align: justify;">email: llctijuana@gmail.com</div>', 1, 0, '', 0, 0);
