INSERT INTO `mdl_page` (`id`, `course`, `name`, `intro`, `introformat`, `content`, `contentformat`, `legacyfiles`, `legacyfileslast`, `display`, `displayoptions`, `revision`, `timemodified`) VALUES
(1, 2, 'Introduccion y Circulos Armonicos', '', 1, '<div><img src="https://fbcdn-sphotos-c-a.akamaihd.net/hphotos-ak-frc1/s720x720/428877_509597562391083_1827618569_n.jpg" alt="Francisco Castañeda" title="Francisco Castañeda" border="0" hspace="0" vspace="0" /><br /></div><div><br /></div>Hola y Bienvenidos<div><br /></div><div>Los armonía es la base de la música. Funciona como el agua para los peces: si no esta presente, no vive la música. Los círculos armónicos son la formula básica de realizar un enunciado musical. Se conforman de 4 acordes que se repiten de manera constante hasta terminar en el primer acorde.</div><div><br /></div>', 1, 0, NULL, 5, 'a:2:{s:12:"printheading";i:0;s:10:"printintro";i:0;}', 1, 1408524413),
(2, 2, 'Ritmos para circulos', '<i>Tener </i>una variedad de <b>ritmos base</b> para utilizar en los círculos armónicos para agregar otro de los <b>elementos base </b>de la música.<br />\r\n', 1, 'Saludos!<div><br /></div><div><br /></div><div><br /></div><div>Los ritmos base son:</div><div><img src="@@PLUGINFILE@@/blues-en-g.jpg" alt="Blues en Sol" title="Blues en Sol" border="0" hspace="0" vspace="0" width="700" height="334" /><br /></div><div><br /></div><div>Segundo Ritmo:</div><div><img src="@@PLUGINFILE@@/2do-ritmo.jpg" alt="Segundo Ritmo" title="Segundo Ritmo" border="0" hspace="0" vspace="0" width="615" height="212" /><br /></div>', 1, 2, NULL, 5, 'a:2:{s:12:"printheading";i:0;s:10:"printintro";i:0;}', 1, 1408524413),
(3, 3, 'Lección 1. Introducción', 'En esta lección estudiarás los primeros 6 siglos del cristianismo católico. <br />\r\n', 1, '<div data-configid="3842813/3203242" style="width: 525px; height: 525px;" class="issuuembed"><div style="width: 100%; height: 100%;">    <div style="height: calc(100% - 18px);"><object style="width: 100%; height: 100%;"><param name="movie" value="http://static.issuu.com/webembed/viewers/style1/v2/IssuuReader.swf?mode=mini&jsAPIClientDomain=cienciayfetijuana.com&jsAPIInitCallback=issuuflashEmbedOnInit01385552529245615&bl_referrer=http%3A%2F%2Fcienciayfetijuana.com%2Fcourse%2Fmodedit.php%3Fupdate%3D6%26return%3D1&documentId=130609160014-b8c73ce07a6976aa58e023ef5f571777&embedId=3842813/3203242" /><param name="allowfullscreen" value="true" /><param name="allowscriptaccess" value="always" /><param name="menu" value="false" /><param name="wmode" value="transparent" /><embed src="http://static.issuu.com/webembed/viewers/style1/v2/IssuuReader.swf" type="application/x-shockwave-flash" allowfullscreen="true" allowscriptaccess="always" menu="false" wmode="transparent" style="width: 100%; height: 100%;" flashvars="mode=mini&jsAPIClientDomain=cienciayfetijuana.com&jsAPIInitCallback=issuuflashEmbedOnInit01385552529245615&bl_referrer=http%3A%2F%2Fcienciayfetijuana.com%2Fcourse%2Fmodedit.php%3Fupdate%3D6%26return%3D1&documentId=130609160014-b8c73ce07a6976aa58e023ef5f571777&embedId=3842813/3203242" /></object></div>    <div style="height: 18px; text-align: left;">        <span style="width: 100%; text-align: left; font-family: ''helvetica neue'', helvetica, arial, sans-serif; font-size: 12px; font-style: normal; font-weight: normal; height: auto; line-height: 18px; margin: 0px; padding: 0px;">            <a href="http://issuu.com/sergioc/docs/01_introduccion" target="_blank">Open publication</a> - Free <a href="http://issuu.com" target="_blank">publishing</a>        </span> </div></div></div><script type="text/javascript" src="http://e.issuu.com/embed.js" async="true"></script>', 1, 0, NULL, 5, 'a:2:{s:12:"printheading";i:0;s:10:"printintro";i:0;}', 1, 1408524413),
(4, 3, 'Lección 2. Conocimientos previos', 'En esta lección el alumno aprenderá a tomar en cuenta varios aspectos de la Historia de la Iglesia como sede de la providencia de Dios y el obrar humano.<br />\r\n<br />\r\n', 1, '<iframe width="525" height="372" src="http://e.issuu.com/embed.html#3842813/3413860" frameborder="0"></iframe>', 1, 0, NULL, 5, 'a:2:{s:12:"printheading";i:0;s:10:"printintro";i:0;}', 1, 1408524413),
(5, 3, 'El origen de la humanidad', '', 1, '<iframe width="560" height="315" src="http://www.youtube.com/embed/eeUAjNLMXNM?list=PLG13c345TsZ_oZlWVVW_nIilhegpiQSdv" frameborder="0"></iframe>', 1, 0, NULL, 5, 'a:2:{s:12:"printheading";i:0;s:10:"printintro";i:0;}', 1, 1408524413),
(6, 3, 'Lección 3. División de la Historia de la Iglesia', 'En esta lección el alumno aprenderá diversas maneras de dividir la Historia de la Iglesia.<br />\r\n<br />\r\n<br />\r\n<br />\r\n', 1, '<iframe width="525" height="371" src="http://e.issuu.com/embed.html#3842813/3414640" frameborder="0"></iframe>', 1, 0, NULL, 5, 'a:2:{s:12:"printheading";i:0;s:10:"printintro";i:0;}', 1, 1408524413),
(7, 3, 'Las pruebas científicas del éxodo', 'Documentales científicos que narran el éxodo bíblico como hecho histórico.<br />\r\n<br />\r\n<br />\r\n', 1, '<iframe width="560" height="315" src="https://www.youtube.com/embed/fXDOee0x3Nk" frameborder="0"></iframe>  <iframe width="560" height="315" src="https://www.youtube.com/embed/Q_iIp17uWzo" frameborder="0"></iframe>', 1, 0, NULL, 5, 'a:2:{s:12:"printheading";i:0;s:10:"printintro";i:0;}', 1, 1408524413),
(8, 3, 'Lección 4. Nacimiento y expansión de la Iglesia Católica', 'En esta sección encontraremos los principales acontecimientos históricos que condujeron a la expansión y consolidación de la Iglesia católica así como los santos Padres latinos y griegos que consolidaron comunidades católicas en los primeros siglos. <br />\r\n<br />\r\n<br />\r\n<br />\r\n', 1, '<iframe width="525" height="372" src="//e.issuu.com/embed.html#3842813/3685516" frameborder="0"></iframe>', 1, 0, NULL, 5, 'a:2:{s:12:"printheading";i:0;s:10:"printintro";i:0;}', 1, 1408524413),
(9, 3, 'Lección 5. Los Concilios Ecuménicos', '<span style="font-family: ''trebuchet ms'', arial, helvetica, sans-serif; font-size: 13px; text-align: justify;">Cuando el Papa quiere tomar una decisión que abarca a toda la cristiandad - proclamar un dogma, modificar la organización de la Iglesia o condenar una herejía -, puede convocar un Concilio Ecuménico. </span><br style="font-family: ''trebuchet ms'', arial, helvetica, sans-serif; font-size: 13px; text-align: justify;" /><span style="font-family: ''trebuchet ms'', arial, helvetica, sans-serif; font-size: 13px; text-align: justify;">Los obispos del mundo entero son llamados a Roma (o a la ciudad que el Pontífice haya escogido). Su presencia es obligatoria, salvo en caso de fuerza mayor. Los superiores de órdenes religiosas, los abades generales, los prelados nullius ( es decir, que no tienen jurisdicción en una diócesis propiamente dicha) y los cardenales son admitidos a participar en el Concilio o Sínodo ecuménico. Tienen voz deliberativa. En esta lección se analizarán los Concilios Ecuménicos.</span>', 1, '<iframe width="525" height="372" src="//e.issuu.com/embed.html#3842813/3685561" frameborder="0"></iframe>', 1, 0, NULL, 5, 'a:2:{s:12:"printheading";i:0;s:10:"printintro";i:0;}', 1, 1408524413),
(10, 3, 'Lección 6. Las misiones de San Pablo', 'En esta lección analizaremos la conversión de San Pablo y sus misiones evangelizadoras.', 1, '<iframe width="420" height="315" src="https://www.youtube.com/embed/a0HirrKPGJQ" frameborder="0"></iframe> \r\n<iframe width="420" height="315" src="https://www.youtube.com/embed/a-h2WvOnX4g" frameborder="0"></iframe> \r\n<iframe width="420" height="315" src="https://www.youtube.com/embed/pF_3QyKlN8Q" frameborder="0"></iframe> \r\n<iframe width="420" height="315" src="https://www.youtube.com/embed/IEHTDlCjgMc" frameborder="0"></iframe> \r\n<iframe width="420" height="315" src="https://www.youtube.com/embed/s1qkeIqXev8" frameborder="0"></iframe> \r\n<iframe width="420" height="315" src="https://www.youtube.com/embed/9gEnX-OHPcc" frameborder="0"></iframe> \r\n<iframe width="420" height="315" src="https://www.youtube.com/embed/kJ124n9xlRE" frameborder="0"></iframe> \r\n<iframe width="420" height="315" src="https://www.youtube.com/embed/qwY6CiaN8tk" frameborder="0"></iframe>', 1, 0, NULL, 5, 'a:2:{s:12:"printheading";i:0;s:10:"printintro";i:0;}', 1, 1408524413),
(11, 5, 'Fenomenología de la Religión', '<span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">Se puede definir la<br />\r\nfenomenología de la religión como </span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">la ciencia que trata de la<br />\r\nperceptibilidad inmediata de la esencia de la religión a través de sus<br />\r\nmanifestaciones (objetos, actos, doctrinas, instituciones, comportamientos y<br />\r\nresultados). </span>', 1, '<iframe width="525" height="1050" src="//e.issuu.com/embed.html#3842813/4375025" frameborder="0"></iframe>', 1, 0, NULL, 5, 'a:2:{s:12:"printheading";i:0;s:10:"printintro";i:0;}', 1, 1408524413),
(12, 6, 'Curso de Italiano', 'Este curso presenta los niveles: básico, intermedio y avanzado.<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n', 1, '<div>Sceglie con il &quot;mouse&quot;:</div><div><br /></div><div><b>Esame preliminare</b>: <a href="http://www.iluss.it/test/test_avanz.htm" target="_blank">http://www.iluss.it/test/test_avanz.htm</a></div><div><br /></div><div>Modalità interattiva:  <a href="http://www.bbc.co.uk/languages/italian/lamappa/episode/1" target="_blank">http://www.bbc.co.uk/languages/italian/lamappa/episode/1</a></div><div><br /></div><h2 style="margin: 0px; padding: 0px; font-family: arial, sans-serif; text-align: justify; background-color: rgb(255, 255, 221);">Coniugatore verbi italiani  </h2><div><a href="http://www.italian-verbs.com/verbi-italiani.htm" target="_blank">http://www.italian-verbs.com/verbi-italiani.htm</a></div><div><br /></div><div>Curso Básico</div><div><table width="500" border="0" align="center" style="color: rgb(0, 0, 0); font-family: ''times new roman''; font-size: 12px;"><tbody><tr align="left" valign="top"><td width="93" height="25"><strong><font color="#CC0000" size="2" face="Verdana, Arial, Helvetica, sans-serif">Lecc. 1ª</font></strong></td><td height="25"><strong><font color="#000000" size="2" face="Verdana, Arial, Helvetica, sans-serif"><u><font color="#660000"><strong><font color="#000000" size="2" face="Verdana, Arial, Helvetica, sans-serif"><a href="http://www.aulafacil.com/Italiano_A1/Curso/Lecc-1.htm" style="color: rgb(0, 0, 0);">Presentarsi</a></font></strong></font></u></font></strong></td></tr><tr align="left" valign="top"><td height="25"><strong><font color="#CC0000" size="2" face="Verdana, Arial, Helvetica, sans-serif">Lecc. 2ª</font></strong></td><td height="25"><font color="#000033"><strong><font size="2" face="Verdana, Arial, Helvetica, sans-serif"><u><u><font size="3" face="Calibri"><strong><font color="#000000" size="2" face="