(1, 2, 0, 'En el año 351 fue el primer concilio ecuménico católico', 'Verdadero', 1, 'Falso', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130729134525+Y1dUri', 'cienciayfetijuana.com+130729134525+3iT0iz', 0, 1375105525, 1375105525, 3, 3),
(2, 5, 0, 'Contesta "True" o "False"', '<span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">El termino </span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">«</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">fen</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">ó</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">meno</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">» (según Hegel)</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;"> es la fase descriptiva\r\ncentrada en la esfera aparencial del objeto en cuesti</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">ó</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">n</span>', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130810232949+vzZdbf', 'cienciayfetijuana.com+130811000849+5pwzPs', 0, 1376177389, 1376179729, 3, 3),
(3, 5, 0, 'Contesta "True" o "False"', '<span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">La Fenomenolog</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">í</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">a, es un método cuyo punto de partida es la\r\nobservaci</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">ó</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">n del hecho que se muestra al sujeto, cuya\r\nfinalidad es interpretar lo que se muestra, lo dado en la experiencia.</span>', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130810233040+tO2a1S', 'cienciayfetijuana.com+130811000857+7daunK', 0, 1376177440, 1376179737, 3, 3),
(4, 5, 0, 'Contesta "True" o "False"', '<span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">Se ha definido la fenomenolog</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">í</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">a de la religi</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">ó</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">n</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;"> como saber descriptivo de la actitud atea.</span>', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130810233228+MpTjnv', 'cienciayfetijuana.com+130811000908+Fe85DY', 0, 1376177548, 1376179748, 3, 3),
(5, 5, 0, 'Contesta "True" o "False"', '<span lang="IT" style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">Se puede entender la fenomenología de la religión como una\r\nciencia que busca la comprensión del fenómeno religioso a partir de sus\r\nmanifestaciones históricas tanto individuales como coletivas</span>', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130810233311+m54q5H', 'cienciayfetijuana.com+130811000830+8YJWwJ', 0, 1376177591, 1376179710, 3, 3),
(6, 5, 0, 'Contesta "True" o "False"', '<span lang="IT" style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">Para la fenomenología de la\r\nreligión, </span><span lang="ES-MX" style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">e</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">l<u> objeto</u> </span><span lang="ES-MX" style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">se </span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">identifica con lo <u>sagrad</u></span><u><span lang="ES-MX" style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">o</span></u><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;"> y el <u>sujeto</u> <u>es\r\nel hombre </u></span><u><span lang="ES-MX" style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">crey</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">ente.</span></u>', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130810233424+2B8S0L', 'cienciayfetijuana.com+130811000821+SzVbVn', 0, 1376177664, 1376179701, 3, 3),
(7, 5, 0, 'Contesta "True" o "False"', '<span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">Para la fenomenología de la religión, como ciencia, no se capta el objeto\r\ndirectamente, sino solo a trav</span><span lang="ES-MX" style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">é</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">s de la actividad espec</span><span lang="ES-MX" style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">í</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">fica del sujeto, cuyo sentido\r\nintenta descifrar.</span>', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130810233547+DY38W2', 'cienciayfetijuana.com+130811000759+OY7bAn', 0, 1376177747, 1376179679, 3, 3),
(8, 5, 0, 'Contesta "True" o "False"', '<span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">En la mostración del fenómeno\r\naparecen tres niveles distintos que corresponden a la vivencia, a la\r\ncomprensión y al testimonio. </span>', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130810233712+zSsF6p', 'cienciayfetijuana.com+130811000749+39qnXd', 0, 1376177832, 1376179669, 3, 3),
(9, 5, 0, 'Contesta "True" o "False"', '<span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">El objetivo de la <u>fenomenolog</u></span><u><span lang="ES-MX" style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">í</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">a de la religi</span><span lang="ES-MX" style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">ó</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">n</span></u><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">  no es analizar\r\nlas respuestas dadas por el hombre a la interpelaci</span><span lang="ES-MX" style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">ó</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">n de lo sagrado, lo otro, asi\r\ncomo conocer la forma de vivir esta llamada</span>', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130810233831+npzuVx', 'cienciayfetijuana.com+130811000738+7zaMBI', 0, 1376177911, 1376179658, 3, 3),
(10, 5, 0, 'Contesta "True" o "False"', '<span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">Para Leeuw el </span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">fenomenólogo de la religión determina su cometido\r\nindicando sus fines propios: 1) Describir los fenómenos y ponerles nombre (</span><span lang="ES-MX" style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">oración</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">, sacrificio; rito, etcétera); 2) Insertar el hecho\r\nen la propia existencia vivenciándolo; 3) Contemplar lo mostrado; 4) Explicitar\r\ny aclarar su sentido; 5) Comprender lo manifestado.</span>', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130810233928+SWRBwK', 'cienciayfetijuana.com+130811000724+PV7nPo', 0, 1376177968, 1376179644, 3, 3),
(11, 5, 0, 'Contesta "True" o "False"', '<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify;"><span style="font-size: 14pt; font-family: cambria, serif;">Se puede definir la\r\nfenomenología de la religión como </span><span style="font-size: 14pt; font-family: cambria, serif;">la ciencia que trata de la\r\nperceptibilidad inmediata de la esencia de la religión a través de sus\r\nmanifestaciones (objetos, actos, doctrinas, instituciones, comportamientos y\r\nresultados). <o:p></o:p></span></p>', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130810234015+eawmHX', 'cienciayfetijuana.com+130811000937+BIpeX1', 0, 1376178015, 1376179777, 3, 3),
(12, 5, 0, 'Contesta "True" o "False"', '<span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">Para Chantepie de la Saussaye  la fenomenología de la religión se puede\r\ndefinir como la </span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">«</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">ciencia que se propone el estudio de la religi</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">ó</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">n, de su esencia y de sus manifestaciones</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">».</span>', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130810234039+4OBUpn', 'cienciayfetijuana.com+130811000928+npKcl0', 0, 1376178039, 1376179768, 3, 3),
(13, 5, 0, 'Contesta "True" o "False"', '<span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">De\r\nmúltiples maneras, en su historia, y hasta el día de hoy, los hombres han\r\nexpresado a su búsqueda de Dios por medio de sus creencias y sus\r\ncomportamientos religiosos (oraciones, sacrificios, cultos, meditaciones,\r\netc.). A pesar de las ambigüedades que pueden entrañar, estas formas de\r\nexpresión son tan particulares que no se puede llamar al hombre un ser religioso.</span>', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130810234328+00n1Sf', 'cienciayfetijuana.com+130811000918+TCbqRq', 0, 1376178208, 1376179758, 3, 3),
(14, 5, 14, 'Random (Default for Diplomado en Ciencia y Fe and sub-categories)', '1', 1, '', 0, 1, '1.0000000', '0.0000000', 'random', 1, 'cienciayfetijuana.com+130811000455+SdyPCg', 'cienciayfetijuana.com+130811000455+mR4i3x', 0, 1376179495, 1376179495, 3, 3),
(15, 5, 15, 'Random (Default for Diplomado en Ciencia y Fe and sub-categories)', '1', 1, '', 0, 1, '1.0000000', '0.0000000', 'random', 1, 'cienciayfetijuana.com+130811000455+oi5j2F', 'cienciayfetijuana.com+130811000455+1XPUyG', 0, 1376179495, 1376179495, 3, 3),
(16, 5, 16, 'Random (Default for Diplomado en Ciencia y Fe and sub-categories)', '1', 1, '', 0, 1, '1.0000000', '0.0000000', 'random', 1, 'cienciayfetijuana.com+130823001114+Zu9kuk', 'cienciayfetijuana.com+130823001138+MuhKYe', 0, 1377216674, 1377216698, 3, 3),
(17, 5, 17, 'Random (Default for Diplomado en Ciencia y Fe and sub-categories)', '1', 1, '', 0, 1, '1.0000000', '0.0000000', 'random', 1, 'cienciayfetijuana.com+130823001143+d84esA', 'cienciayfetijuana.com+130823001143+7eazRI', 0, 1377216703, 1377216703, 3, 3),
(18, 7, 0, 'Contesta Verdadero o Falso', 'La historia de las religiones no  expresa juicios de valor acerca del status o mérito epistemológico o teológico de los fenómenos que son estudiados; sencillamente intenta comprender su significado.', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130823001330+GQFPz4', 'cienciayfetijuana.com+130823001607+5F09vB', 0, 1377216810, 1377216967, 3, 3),
(19, 7, 0, 'Contesta Verdadero o Falso', 'La historia de las religiones no  expresa juicios de valor acerca del status o mérito epistemológico o teológico de los fenómenos que son estudiados; sencillamente intenta comprender su significado.', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130823001546+9nABaB', 'cienciayfetijuana.com+130823001547+hsM3to', 0, 1377216946, 1377216946, 3, 3),
(20, 7, 0, 'Exámen de Historia de las Religiones', 'El término historia de las religiones  estudiará los fenómenos religiosos de manera ahistórica.', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130823204427+4LPy1F', 'cienciayfetijuana.com+130823204427+oxlpQl', 0, 1377290667, 1377290667, 3, 3),
(21, 7, 0, 'Exámen de Historia de las Religiones', 'La historia de las religiones, ¿siempre se va a limitar a sí misma a una sola religión o a un solo aspecto de la religión?', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130823204709+S8uCVY', 'cienciayfetijuana.com+130823204709+JdDMAt', 0, 1377290829, 1377290829, 3, 3),
(22, 7, 0, 'Exámen de Historia de las Religiones', 'La historia de las religiones se ha beneficiado de las ciencias como la sociología, la antropología, y la psicología, que estudian los mismos fenómenos religiosos, ya que  han aportado y continúan aportando importantes contribuciones al estudio de la religión.', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130823205005+NAKgI0', 'cienciayfetijuana.com+130823205005+lMNARH', 0, 1377291005, 1377291005, 3, 3),
(23, 7, 0, 'Exámen de Historia de las Religiones', '<div>La historia de las religiones no se limita a la verificación y explicación analítica de datos religiosos aislados, según son estudiados aisladamente por las diversas disciplinas especializadas, como la filología, arqueología y etnología, que están relacionadas con la investigación histórica. Pretende coordinar los datos religiosos unos con otros establecer relaciones y agrupar los hechos según estas relaciones.</div><div><br /></div>', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130823205427+SOGckw', 'cienciayfetijuana.com+130823205427+7pFBfE', 0, 1377291267, 1377291267, 3, 3),
(24, 7, 0, 'Exámen de Historia de las Religiones', 'La historia de las religiones utiliza el método científico cuando estudia los fenómenos religiosos. ', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130823205610+ZxEOak', 'cienciayfetijuana.com+130823205631+3lQxVA', 0, 1377291370, 1377291391, 3, 3),
(25, 7, 0, 'Exámen de Historia de las Religiones', 'La religión es ante todo un fenómeno que tiene lugar en un sujeto humano y se expresa en signos y símbolos desde la óptima de la Historia de las Religiones.', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130823205853+UEuaoj', 'cienciayfetijuana.com+130823210112+FBIHX9', 0, 1377291533, 1377291672, 3, 3),
(26, 7, 0, 'Exámen de Historia de las Religiones', 'El primer requisito de un estudio comparado de las religiones es la suspensión de todo prejuicio, lo que de ninguna manera implica renunciar a las propias convicciones religiosas.', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130823210251+iyyXI8', 'cienciayfetijuana.com+130823210251+hXsllL', 0, 1377291771, 1377291771, 3, 3),
(27, 7, 0, 'Exámen de Historia de las Religiones', 'El historiador de la historia de las religiones debe imponer <i>a priori </i>estructuras o teorías para explicar el significado de la historia.', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130823210618+iPGWqo', 'cienciayfetijuana.com+130823210618+m9qmpt', 0, 1377291978, 1377291978, 3, 3),
(28, 7, 0, 'Exámen de Historia de las Religiones', 'El método comparativo busca modelos básicos o estructuras fundamentales vistas en una comparación de fenómenos religiosos, y lo mira como el rasgo central mediante el cual la expresión religiosa es comprendida.', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130823210733+Ualt6K', 'cienciayfetijuana.com+130823210733+jL89Nx', 0, 1377292053, 1377292053, 3, 3),
