(49, 10, 0, 'Exámen de Teología Fundamental', '<font face="arial, helvetica, sans-serif"><span style="text-align: justify; text-indent: -18pt;">El empleo del término «</span><b style="text-align: justify; text-indent: -18pt;">teología</b><span style="text-align: justify; text-indent: -18pt;">» para designar la investigación, exposición y penetración de la realidad total del hombre y del mundo en la perspectiva de la revelación se impuso en Occidente aproximadamente en el transcurso del siglo XII.</span></font>', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130907065415+QgVrOB', 'cienciayfetijuana.com+130907071145+HBQbNJ', 0, 1378536855, 1378537905, 3, 3),
(50, 10, 0, 'Exámen de Teología Fundamental', '<p class="MsoListParagraph" style="text-align: justify; text-indent: -18pt;">   La <b>teología</b>, entendida como el esfuerzo por una asimilación teórica y una\r\ntraducción de la revelación es parte constitutiva del magisterio universal de\r\nla Iglesia.<span lang="ES-MX"><o:p></o:p></span></p>', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130907065644+WHJ27I', 'cienciayfetijuana.com+130907071459+SgVV2p', 0, 1378537004, 1378538099, 3, 3),
(51, 10, 0, 'Exámen de Teología Fundamental', '<span style="font-size: 11pt; line-height: 115%;"><font face="arial, helvetica, sans-serif">Toma a su cargo la investigación hermenéutica e histórica de la verdadera\r\nintención de las sentencias divinas contenidas en las fuentes normativas de la\r\nfe (Escritura, tradición, vida y doctrina de la Iglesia).</font></span>', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+130907070234+jwmVJ6', 'cienciayfetijuana.com+130907071220+HXQpRr', 0, 1378537354, 1378537940, 3, 3),
(52, 10, 0, 'Exámen de Teología Fundamental', '<span style="font-size: 11pt; line-height: 115%;"><font face="arial, helvetica, sans-serif">Tiene como misión concebir de manera racional la fe en su conjunto global y de\r\nestablecer un diálogo fecundo entre esta fe y la percepción de la realidad de\r\nlos hombres tal como se refleja especialmente en la filosofía, aunque también\r\nen las ciencias históricas, sociales y naturales</font></span>', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+130907070713+90fMvp', 'cienciayfetijuana.com+130907070713+olnFBm', 0, 1378537633, 1378537633, 3, 3),
(53, 10, 0, 'Exámen de Teología Fundamental', '<span style="font-size: 11pt; line-height: 115%;"><font face="arial, helvetica, sans-serif">Su objetivo consiste enreflexionar sobre la configuración individual y social de la vida cristiana en\r\nla Iglesia y de la Iglesia en relación con la sociedad.</font></span>', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+130907071424+Vpwpdb', 'cienciayfetijuana.com+130907071424+xEh1XH', 0, 1378538064, 1378538064, 3, 3),
(54, 10, 0, 'Exámen de Teología Fundamental', '<div style="text-align: justify; text-indent: -24px;"><font face="arial, helvetica, sans-serif">       La  <b>teodicea </b>, a diferencia de la <b>teología de la revelación</b>, conoce a Dios como autor de la revelación y fundamenta aquí la unidad de los contenidos de la fe, a los que se refiere con la razón iluminada por la fe.</font></div>', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130907071658+d4LMg9', 'cienciayfetijuana.com+130907071921+F5S9Bz', 0, 1378538218, 1378538361, 3, 3),
(55, 10, 0, 'Exámen de Teología Fundamental', 'El giro antropocéntrico efectuado por la filosofía contemporánea no tuvo  repercusiones en la definición del objeto formal de la teología.', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130907072210+xm4hvT', 'cienciayfetijuana.com+130907072210+5hMhcR', 0, 1378538530, 1378538530, 3, 3),
(56, 10, 0, 'Exámen de Teología Fundamental', '<font face="arial, helvetica, sans-serif">Según Rahner: “La teología no es, en un sentido primero y originario, un sistema de sentencias validas construido por el pensamiento humano, sino la totalidad del discurso divino dirigido por Dios mismo —aunque en lenguaje humano— a los hombres”\r\n\r\n</font>', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130907072354+FMj702', 'cienciayfetijuana.com+130907072354+d7ukKL', 0, 1378538634, 1378538634, 3, 3),
(57, 10, 0, 'Exámen de Teología Fundamental', '<font face="arial, helvetica, sans-serif">Desde la Constitución pastoral del II concilio Vaticano, las encíclicas sobre los retos políticos y sociales mundiales, las conferencias episcopales latinoamericanas de Medellín, Puebla, Santo Domingo  se ha ido configurando un nuevo esquema de referencia, que afecta también a la definición del objeto formal de la teología.\r\n\r\n</font>', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130907072508+KQp6QF', 'cienciayfetijuana.com+130907072508+NOuAEi', 0, 1378538708, 1378538708, 3, 3),
(58, 10, 0, 'Exámen de Teología Fundamental', 'Si por teología se entiende el esfuerzo científico en torno a una iluminación racional de la fe cristiana, de su realización en el curso de la historia y de su pretensión de validez eclesial y social, puede decirse que las especialidades sistemáticas configuran, con la dogmática, la teología moral y la teología fundamental, el «tronco científico» de la teología.', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130907072705+JDbzaH', 'cienciayfetijuana.com+130907072705+y1R9uZ', 0, 1378538825, 1378538825, 3, 3),
(59, 11, 0, 'Exámen Moral Fundamental', 'La Teología moral fundamental incluye todo lo relativo a las acciones libres del hombre y el último, o supremo, fin a alcanzarse a través de ellos, hasta donde lo conocemos por la misma divina revelación; en otras palabras, incluye el fin sobrenatural, la regla o norma, del orden moral, las acciones humanas como tales, su armonía o disonancia con las leyes del orden moral, sus consecuencias, las ayudas divinas para su recto cumplimiento.', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130925151444+4WHd46', 'cienciayfetijuana.com+130925221749+5IEAKr', 0, 1380122084, 1380147469, 3, 3),
(60, 11, 0, 'Exámen Moral Fundamental', 'Una manera de definir la <b>libertad </b>es  el poder, radicado en la razón y en la voluntad, de obrar o de no obrar, de hacer esto o aquello, de ejecutar así por sí mismo acciones deliberadas. ', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130925151609+22h0A0', 'cienciayfetijuana.com+130925151610+GzQzRL', 0, 1380122169, 1380122169, 3, 3),
(61, 11, 0, 'Exámen Moral Fundamental', 'Hay verdadera libertad cuando no se busca el bien ni la justicia', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130925151815+MPstz8', 'cienciayfetijuana.com+130925151815+Wvrl18', 0, 1380122295, 1380122295, 3, 3),
(62, 11, 0, 'Exámen Moral Fundamental', 'Acrecientan el dominio de la voluntad sobre los propios actos las siguientes opciones:', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+130925152041+xNgd7y', 'cienciayfetijuana.com+130925222545+JN03lB', 0, 1380122441, 1380147945, 3, 3),
(63, 11, 0, 'Exámen Moral Fundamental', 'Para que el efecto malo de un acto voluntario sea imputable, es preciso:', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+130925152229+q7YFx1', 'cienciayfetijuana.com+130925222907+BDmFyh', 0, 1380122549, 1380148147, 3, 3),
(64, 11, 0, 'Exámen Moral Fundamental', 'La <b>ley </b>es una regla de conducta proclamada por la autoridad competente para el bien común', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130925152343+i2xoWG', 'cienciayfetijuana.com+130925152343+lbLAwy', 0, 1380122623, 1380122623, 3, 3),
(65, 11, 0, 'Exámen Moral Fundamental', '<div>La <b>ley natural</b> permanece como una norma que une entre sí a los hombres y les impone, por encima de las diferencias inevitables, principios comunes.</div><div><br /></div>', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130925152701+DYD0CW', 'cienciayfetijuana.com+130925152701+egKdon', 0, 1380122821, 1380122821, 3, 3),
(66, 11, 0, 'Exámen Moral Fundamental', 'La ley natural es:', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+130925153013+6SbYKv', 'cienciayfetijuana.com+130925222613+iQ7HUR', 0, 1380123013, 1380147973, 3, 3),
(67, 11, 0, 'Exámen Moral Fundamental', 'Se le llama la Ley nueva o Ley evangélica a la perfección aquí  de la ley divina, natural y revelada.', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130925153149+N9V9L2', 'cienciayfetijuana.com+130925153149+a91WXQ', 0, 1380123109, 1380123109, 3, 3),
(68, 11, 0, 'Exámen Moral Fundamental', 'La moralidad de los actos humanos depende de: ', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+130925153349+SmPHJn', 'cienciayfetijuana.com+130925222521+nWcijH', 0, 1380123229, 1380147921, 3, 3),
(69, 11, 0, 'Exámen Moral Fundamental', 'El <b>fin de la acción</b> es el término primero de la intención y designa el objetivo buscado en la acción', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130925153515+7dhLQn', 'cienciayfetijuana.com+130925153515+Icn32J', 0, 1380123315, 1380123315, 3, 3),
(70, 11, 0, 'Exámen Moral Fundamental', '¿Es cierto que el<b> fin de una acción</b> elegida no justifica los medios?', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130925153623+RRy83Z', 'cienciayfetijuana.com+130925153623+lrxeSH', 0, 1380123383, 1380123383, 3, 3),
(71, 11, 0, 'Exámen Moral Fundamental', '<div>¿Una intención mala sobreañadida (como la vanagloria) no convierte en malo un acto que, de suyo, puede ser bueno (como la limosna) ?</div><div><br /></div>', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130925153827+YURSXw', 'cienciayfetijuana.com+130925153827+rLQEON', 0, 1380123507, 1380123507, 3, 3),
(72, 11, 0, 'Exámen Moral Fundamental', 'El acto moralmente bueno supone a la vez la bondad de:', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+130925220201+UgGhuW', 'cienciayfetijuana.com+130925222649+ObRDlq', 0, 1380146521, 1380148009, 3, 3),
(73, 11, 0, 'Exámen Moral Fundamental', 'No hay actos que, por sí y en sí mismos, independientemente de las circunstancias y de las intenciones, son siempre gravemente ilícitos por razón de su objeto.', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130925220358+dMxFZl', 'cienciayfetijuana.com+130925220358+s68X0K', 0, 1380146638, 1380146638, 3, 3),
(74, 11, 0, 'Exámen Moral Fundamental', 'No está permitido hacer el mal para obtener un bien.', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130925220808+CLL2az', 'cienciayfetijuana.com+130925220808+dePKGN', 0, 1380146888, 1380146888, 3, 3),
(75, 11, 0, 'Exámen Moral Fundamental', 'La moralidad no puede ser juzgada si se prescinde de la conformidad u oposición de la elección deliberada de un comportamiento concreto respecto a la dignidad y a la vocación integral de la persona humana.', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130925220929+4196oi', 'cienciayfetijuana.com+130925220929+T3IdGZ', 0, 1380146969, 1380146969, 3, 3),
(76, 11, 0, 'Exámen Moral Fundamental', 'Los preceptos morales negativos, es decir, los que prohiben algunos actos o comportamientos concretos como intrínsecamente malos, no admiten ninguna excepción legítima.', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130925221023+uW6Lun', 'cienciayfetijuana.com+130925221023+xUz7K1', 0, 1380147023, 1380147023, 3, 3),
(77, 11, 0, 'Exámen Moral Fundamental', 'El consecuencialismo  pretende obtener los criterios de la rectitud de un obrar determinado sólo del cálculo de las consecuencias que se prevé pueden derivarse de la ejecución de una decisión.', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130925221504+uA8I6R', 'cienciayfetijuana.com+130925221504+ApMvsJ', 0, 1380147304, 1380147304, 3, 3),
(78, 11, 0, 'Exámen Moral Fundamental', 'El consecuencialismo y el proporcionalismo  no son fieles a la doctrina de la Iglesia Católica, en cuanto creen poder justificar, como moralmente buenas, elecciones deliberadas de comportamientos contrarios a los mandamientos de la ley divina y natural.', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130925221603+AuZ8Sl', 'cienciayfetijuana.com+130925221603+zCa6Ma', 0, 1380147363, 1380147363, 3, 3),
(79, 12, 0, 'Examen de Teología Católica', '<span style="font-size: 10.5pt; line-height: 115%; font-family: arial, sans-serif;">Es cierto que de acuerdo a la Teología Católica, ¿Dios no cesa de atraer a la persona hacia sí, para que viva y encuentre en Él aquella plenitud de verdad y felicidad a la que aspira sin descanso? (Cf. CEC 27-30; 44-45)</span>', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130926135615+rkCDPz', 'cienciayfetijuana.com+130926141333+TY7gQr', 0, 1380203775, 1380204813, 3, 3),
(80, 12, 0, 'Examen de Teología Católica', 'Es cierto que como el hombre con la sola razón encuentra muchas dificultades en conocer a Dios, ¿Dios ha querido iluminarlo con su Revelación, no sólo acerca de las verdades que superan la comprensión humana, sino también sobre verdades religiosas y morales que pueden ser conocidas por todos sin dificultad, con firme certeza y sin mezcla de error? (Cf. 37-38)', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130926140105+YlVzEw', 'cienciayfetijuana.com+130926140105+ZnAJM1', 0, 1380204065, 1380204065, 3, 3),
(81, 12, 0, 'Examen de Teología Católica', '¿Qué ha revelado Dios de acuerdo a la Teología Católica? (Cf. CEC 50-53; 68-69)', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+130926140621+hyDoK0', 'cienciayfetijuana.com+130926140621+YpW61o', 0, 1380204381, 1380204381, 3, 3),
(82, 12, 0, 'Examen de Teología Católica', '¿Cuál era la <b>condición original</b> del hombre según el designio de <br />Dios? (Cf. 374-379; 384 )', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+130926141252+jJacm6', 'cienciayfetijuana.com+130926141720+bNacXl', 0, 1380204772, 1380205040, 3, 3),
(83, 12, 0, 'Examen de Teología Católica', 'Con la expresión &quot;caída de los ángeles&quot; (Cf. CEC 391-395; 414) se indica:', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+130926142319+UhMO1g', 'cienciayfetijuana.com+130926142319+L90inK', 0, 1380205399, 1380205399, 3, 3),
(84, 12, 0, 'Examen de Teología Católica', '¿Qué se entiende por la expresión &quot;cielo&quot;? (Cf. CEC 1023-1026; 1053)', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+130926143010+QuiEgT', 'cienciayfetijuana.com+130926143038+swqhXz', 0, 1380205810, 1380205838, 3, 3),
(85, 12, 0, 'Examen de Teología Católica', 'Si el estado del<b> purgatorio</b> (Cf. CEC #1030-1031;1054) <b>es </b>el estado de los que mueren en amistad con Dios pero, aunque estén seguros de su salvación eterna, necesitan aún de purificación para entrar en la eterna bienaventuranza; ¿<b>cómo podemos ayudar en esta purificación a la gente en el estado del purgatorio</b>? ', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+130926143626+KzZ3rm', 'cienciayfetijuana.com+130926143626+aq3XId', 0, 1380206186, 1380206186, 3, 3),
(86, 12, 0, 'Examen de Teología Católica', '¿Cómo se concilia la existencia del &quot;infierno&quot; (lugar de la eterna condenación del ser humano o ángel) con la infinita bondad de Dios? (Cf. CEC #1033-1035;1036-1037;1056-1057)', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+130926144412+0epHvP', 'cienciayfetijuana.com+130926144527+w54mVd', 0, 1380206652, 1380206727, 3, 3),
(87, 12, 0, 'Examen de Teología Católica', 'El <b>juicio final </b>(Cf. CEC #1038-1041;1058-1059) ¿consiste en la sentencia de vida bienaventurada o de condena eterna que el Señor Jesús emitirá respecto de los justos y de los pecadores (Hch 24,15), reunidos todos juntos delante de sí, participando así el cuerpo resucitado de la retribución que el alma ha recibido en el juicio particular?', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130926144913+dkTOo1', 'cienciayfetijuana.com+130926144913+Xvsfxw', 0, 1380206953, 1380206953, 3, 3),
(88, 12, 0, 'Examen de Teología Católica', '¿Es cierto que <b>sólo Dios conoce el día y la hora del</b> <b>juicio final</b>, ni los ángeles ni ningún ser humano? (Cf CEC #1040)', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130926145141+Z28bnw', 'cienciayfetijuana.com+130926145212+mImFit', 0, 1380207101, 1380207132, 3, 3),
(89, 13, 0, 'Exámen de los Evangelios sinópticos', '¿Cuántos libros son considerados como canónicos (es decir, inspirados por Dios) del Nuevo Testamento?', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+130927042600+kszAEK', 'cienciayfetijuana.com+130927042600+34VUB2', 0, 1380255960, 1380255960, 3, 3),
(90, 13, 0, 'Exámen de los Evangelios sinópticos', 'La palabra &quot;Evangelio&quot; significa:', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+130927043530+H4za5G', 'cienciayfetijuana.com+130927043530+ZdBJlP', 0, 1380256530, 1380256530, 3, 3),
(91, 13, 0, 'Exámen de los Evangelios Sinópticos', ' ¿Es cierto que a los evangelios según San Marcos, San Mateo y San Lucas se les llama Evangelios sinópticos porque los tres siguen una estructura similar, presentan el mismo cuadro de hechos y espacios geográficos por donde anduvo Jesús?', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130927190928+GoK0wd', 'cienciayfetijuana.com+130927190928+Agaaau', 0, 1380308968, 1380308968, 3, 3),
(92, 13, 0, 'Exámen de los Evangelios Sinópticos', 'Se dice que éste Evangelio fue escrito alrededor del año 70 y que sus destinatarios son cristianos paganos, por eso tiene que explicar costumbres judías y palabras arameas.', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+130927191221+CYSX8f', 'cienciayfetijuana.com+130927191221+RNcR2D', 0, 1380309141, 1380309141, 3, 3),
(93, 13, 0, 'Exámen de los Evangelios Sinópticos', 'Se dice que este Evangelio fue escrito después de los años 80, sus destinatarios son principalmente judeocristianos pero separados del judaísmo y que hace de puente entre el Antiguo y el Nuevo Testamento. ', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+130927191421+FqV4Yw', 'cienciayfetijuana.com+130927191422+FgqSOI', 0, 1380309261, 1380309261, 3, 3),
(94, 13, 0, 'Exámen de los Evangelios Sinópticos', 'Éste evangelio nos presenta 4 grandes discursos:<div>1) El discurso del Monte  (cap. 5,1 al cap. 7,29)</div><div>2) El discurso de los enviados (cap. 10, 1-42)</div><div>3) El discruso contra los falsos dirigentes (cap. 23, 1-39)</div><div>4) El discruso acerca del fin del mundo (cap. 24,1 al cap 25,46)</div>', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+130927191758+Tr3iNC', 'cienciayfetijuana.com+130927191759+cGWCe2', 0, 1380309478, 1380309478, 3, 3),
(95, 13, 0, 'Exámen de los Evangelios Sinópticos', 'Éste evangelio fue escrito alrededor del año 85, sus destinatarios son mayoritariamente cristianos griegos y el evangelista les escribe para confirmarlos, como lo dice en el inicio del su Evangelio.', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+130927192017+JChbgo', 'cienciayfetijuana.com+130927192017+tmz8oU', 0, 1380309617, 1380309617, 3, 3),
(96, 13, 0, 'Exámen de los Evangelios Sinópticos', '¿Es cierto que el Evangelio según San Lucas toma muy en cuenta a los pobres, por eso los necesitados encuentran gran acogida en Jesús?', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130927192217+nastNM', 'cienciayfetijuana.com+130927192217+9QF3QW', 0, 1380309737, 1380309737, 3, 3),
(97, 13, 0, 'Exámen de los Evangelios Sinópticos', 'Este Evangelio se terminó de escribir alrededor del año 95. Y la comunidad a la que escribe está formada por judíos, samaritanos y paganos convertidos a la fe en Jesús.', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+130927193801+tLP7RR', 'cienciayfetijuana.com+130927193801+tP95SA', 0, 1380310681, 1380310681, 3, 3),
(98, 13, 0, 'Exámen de los Evangelios Sinópticos', '¿Es cierto que el <b>Evangelio según San Mateo</b> nos presenta a partir del cap. 13 al 17 el SECRETO que Jesús comparte y revela únicamente a sus seguidores: que da el Mandamiento del amor, promete que estará entre la comunidad de manera distinta y promete mandar al Paráclito que es el Espíritu Santo?', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+130927194206+96oLLI', 'cienciayfetijuana.com+130927194206+hPOKun', 0, 1380310926, 1380310926, 3, 3),
(99, 16, 0, 'Pregunta 1', '<div>¿Es cierto que la aparición de disciplinas abocadas al fenómeno religioso como tal (Ciencias de la Religión, Historia de las Religiones, Religiones Comparadas, Psicología de la Religión, Sociología de la Religión, etc.) ha colaborado a focalizar más analítica y ampliamente el hecho religioso en su multitud de expresiones?</div>', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+140215054628+uZL7pX', 'cienciayfetijuana.com+140215054936+jN1JDq', 0, 1392443188, 1392443376, 3, 3),
(100, 16, 0, 'Pregunta 2', '<div>¿Es cierto que la ciencia se construye como una elaboración crítica de la experiencia sobre el mundo, utilizando una experimentación controlada y matematizada y un afinado conjunto de métodos?</div>', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+140215054812+lodRGq', 'cienciayfetijuana.com+140215054927+Ke4TVY', 0, 1392443292, 1392443367, 3, 3),
(101, 16, 0, 'Pregunta 3', '¿Es cierto que la Teología ha sido caracterizada históricamente como una aplicación de la racionalidad humana sobre el dato objetivo de la revelación divina?', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+140215054916+rt1UVP', 'cienciayfetijuana.com+140215054916+pluEE5', 0, 1392443356, 1392443356, 3, 3),
(102, 16, 0, 'Pregunta 4', '¿Es cierto que la Teología católica ha sido elaborada durante muchos siglos antes de plantearse críticamente su estatuto epistemológico y los criterios de confección de la misma.?', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+140215055027+J86Pc8', 'cienciayfetijuana.com+140215055027+ctwDt1', 0, 1392443427, 1392443427, 3, 3),
(103, 16, 0, 'Pregunta 5', '¿Se podría afirmar que la asociación entre Teología y Ciencia es responsabilidad de la escolástica medieval?', 1, '', 1, 1, '1.0000000', '1.0000000', 'truefalse', 1, 'cienciayfetijuana.com+140215055138+cyWBU5', 'cienciayfetijuana.com+140215055138+6N3XYP', 0, 1392443498, 1392443498, 3, 3),
(104, 16, 0, 'Pregunta 6', 'Para este autor, en su obra escrita llamada &quot;Theology in the age of science&quot; procura llegar a una comprensión de lo natural y de lo divino con las categorías construidas desde las ciencias naturales.', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+140215055345+5oQVur', 'cienciayfetijuana.com+140215055813+3GnLGc', 0, 1392443625, 1392443893, 3, 3),
(105, 16, 0, 'Pregunta 7', 'Para este autor, una posibilidad del diálogo entre la Teología y las ciencias es pasar de categorías esencialistas hacia categorías personalistas, ya que los varios saberes contribuyen a la autocomprensión del sujeto y a la determinación de sus elecciones existenciales, incluida la religiosa. ', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+140215055616+cTVkl4', 'cienciayfetijuana.com+140215055849+emTttR', 0, 1392443776, 1392443929, 3, 3),
(106, 16, 0, 'Pregunta 8', '<div>Para Giuseppe Tanella-Nitti (radioastrónomo y teólogo católico) se ha producido una progresiva recepción de la visión contemporánea sobre el cosmos físico, sobre la vida y sobre la especie humana como horizonte contextual irrenunciable para una mejor comprensión de la doctrina bíblica sobre la creación y de la misma historia de la salvación.(cfr. &quot;Del diálogo a la ingegración intelectual: algunas premisas epistemológicas&quot;).</div><div><br /></div>', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+140215060106+uDTFRo', 'cienciayfetijuana.com+140215060106+74KueM', 0, 1392444066, 1392444066, 3, 3),
(107, 16, 0, 'Pregunta 9', 'Para éste autor, la utilización de dos nociones merecería una atención particular: la de trascendencia y la de experiencia. En el empleo de la primera, crucial para todo el discurso teológico, se debería saber mostrare su conexión con el análisis de las ciencias y con sus relativas aperturas epistemológicas y antropológicas; en el empleo de la segunda, crucial para todo el discurso científico, se debería saber explicar en qué modo la experiencia de las cosas de Dios y la experiencia de las ciencias entrecruzan la esfera del mundo sensible y de la historia.   ', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+140215060504+ETkOeC', 'cienciayfetijuana.com+140215060504+PQXozB', 0, 1392444304, 1392444304, 3, 3),
(108, 16, 0, 'Pregunta 10', 'Para éste autor, la Revelación que nos instruye, debería ser hecha en base a la perspectiva científica, con consecuentes posibles implicaciones para la escatología, tratándose de implicaciones y no necesariamente de problematizaciones, por tanto, de exigencias de inteligibilidad para una mejor comprensión dogmática de la Revelación misma.', 1, '', 1, 1, '1.0000000', '0.1000000', 'multichoice', 1, 'cienciayfetijuana.com+140215060736+5pzSQB', 'cienciayfetijuana.com+140215060736+jrKkGG', 0, 1392444456, 1392444456, 3, 3);
