(15, 8, 'True', 2, '1.0000000', '<span style="font-size: 14pt; line-height: 21px; font-family: cambria, serif;">Cierto. La fenomenolog</span><span lang="ES-MX" style="font-size: 14pt; line-height: 21px; font-family: cambria, serif;">í</span><span style="font-size: 14pt; line-height: 21px; font-family: cambria, serif;">a de la religi</span><span lang="ES-MX" style="font-size: 14pt; line-height: 21px; font-family: cambria, serif;">ó</span><span style="font-size: 14pt; line-height: 21px; font-family: cambria, serif;">n tiene en cuenta de manera especial los dos </span><span lang="ES-MX" style="font-size: 14pt; line-height: 21px; font-family: cambria, serif;">ú</span><span style="font-size: 14pt; line-height: 21px; font-family: cambria, serif;">ltimos y trata de comprender y justificar la vivencia haciendo ver su </span><span style="font-size: 14pt; line-height: 21px; font-family: cambria, serif;"></span><span style="font-size: 14pt; line-height: 21px; font-family: cambria, serif;">estructura constitutiva y sentido </span><span lang="ES-MX" style="font-size: 14pt; line-height: 21px; font-family: cambria, serif;">ú</span><span style="font-size: 14pt; line-height: 21px; font-family: cambria, serif;">ltimo.</span>\r\n', 1),
