(18, 9, 'False', 2, '1.0000000', 'Cierto: <span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">El objetivo de la <u>fenomenolog</u></span><u><span lang="ES-MX" style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">í</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">a de la religi</span><span lang="ES-MX" style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">ó</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">n</span></u><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">  es analizar\r\nlas respuestas dadas por el hombre a la interpelaci</span><span lang="ES-MX" style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">ó</span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">n de lo sagrado, lo otro, así como conocer la forma de vivir esta llamada. Por este procedimiento llega a\r\ndescubrir la fe del creyente en Dios y su comportamiento para con él, pero sin\r\npoder decir nada más que él es lo otro. </span>', 1),
