(31, 20, 'True', 2, '0.0000000', 'No. El término historia de las religiones  estudiará los fenómenos religiosos de manera histórica y comparada.', 1),
(32, 20, 'False', 2, '1.0000000', 'Correcto. El término historia de las religiones  estudiará los fenómenos religiosos de manera histórica y comparada.\r\n\r\n', 1),
(33, 21, 'True', 2, '0.0000000', 'Incorrecto. La historia de las religiones, que <b>no se limita a sí misma a una sola religión</b> o a un solo aspecto de la religión, sino que estudia al menos unas cuantas religiones para poder compararlas, intenta comprender las modalidades de la conducta religiosa y las instituciones y creencias contenidas en mitos, rituales, concepciones de dioses superiores, etc', 1),
(34, 21, 'False', 2, '1.0000000', 'Correcto. La <b>historia de las religiones</b>, que <b>no se limita a sí misma a una sola religión</b> o a un solo aspecto de la religión, sino que estudia al menos unas cuantas religiones para poder compararlas, intenta comprender las modalidades de la conducta religiosa y las instituciones y creencias contenidas en mitos, rituales, concepciones de dioses superiores, etc', 1),
