(38, 23, 'False', 2, '0.0000000', 'Incorrecto.', 1),
(39, 24, 'True', 2, '1.0000000', 'Correcto. El campo de estudio de la Historia de las Religiones   se compone de hechos religiosos, que son subjetivos y objetivos: subjetivos, porque se ocupan de los pensamientos, sentimientos e intenciones de personas religiosas que se expresan en sus actos externos; objetivos, porque estas expresiones son objetivadas en mitos, símbolos, rituales y actitudes externas en las diferentes religiones. \r\n', 1),
(40, 24, 'False', 2, '0.0000000', 'Incorrecto. La historia de las religiones sí utiliza el método científico porque estudia los fenómenos religiosos. Su campo de estudio se compone de hechos religiosos, que son subjetivos y objetivos: subjetivos, porque se ocupan de los pensamientos, sentimientos e intenciones de personas religiosas que se expresan en sus actos externos; objetivos, porque estas expresiones son objetivadas en mitos, símbolos, rituales y actitudes externas en las diferentes religiones. \r\n', 1),
(41, 25, 'True', 2, '1.0000000', 'Correcto.\r\n', 1),
(42, 25, 'False', 2, '0.0000000', 'Incorrecto. La religión para la Historia de las Religiones es ante todo un fenómeno que tiene lugar en un sujeto humano y se expresa en signos y símbolos.\r\n', 1),
(43, 26, 'True', 2, '1.0000000', 'Correcto. Desde la óptima de la Historia de las Religiones el primer requisito de un estudio comparado de las religiones sí es la suspensión de todo prejuicio, lo que de ninguna manera implica renunciar a las propias convicciones religiosas.', 1),
(44, 26, 'False', 2, '0.0000000', 'Incorrecto. Vuelve a intentar.', 1),
(45, 27, 'True', 2, '0.0000000', 'Falso. El historiador no puede imponer a priori estructuras o teorías para explicar el significado de la historia; los modelos y estructuras se originan a partir del estudio de los fenómenos históricos mismos, por medio de los cuales puede dar él sentido generalizado a acontecimientos específicos', 1),
(46, 27, 'False', 2, '1.0000000', 'Correcto. El historiador no puede imponer a priori estructuras o teorías para explicar el significado de la historia; los modelos y estructuras se originan a partir del estudio de los fenómenos históricos mismos, por medio de los cuales puede dar él sentido generalizado a acontecimientos específicos', 1),
