(184, 71, 'True', 2, '0.0000000', 'Incorrecto. Una intención <u>mala </u>sobreañadida (como la vanagloria) <u>sí</u> convierte en <u>malo </u>un acto que, de suyo, puede ser bueno (como la limosna)<div><br /></div>', 1),
