(190, 73, 'True', 2, '0.0000000', 'Incorrecto. <b>Hay actos</b> que, por <b>sí </b>y en sí mismos, independientemente de las circunstancias y de las intenciones, <b>son siempre gravemente ilícitos</b> por razón de su <b>objeto</b>; por ejemplo, la blasfemia y el perjurio, el homicidio y el adulterio.', 1),
(191, 73, 'False', 2, '1.0000000', 'Correcto. Hay actos que, por sí y en sí mismos, independientemente de las circunstancias y de las intenciones, son siempre gravemente ilícitos por razón de su objeto; por ejemplo, la blasfemia y el perjurio, el homicidio y el adulterio.', 1),
(192, 74, 'True', 2, '1.0000000', 'Correcto. La excepción es el principio de doble efecto (dos efectos uno bueno y el otro malo). En el cual la acción del acto que genera un efecto malo también genera un efecto bueno y las reglas para ejecutarlos son:<div>El objeto del acto que se persigue debe ser bueno.<div>La intención del que actúa debe ser buena y excluye (no desea, pero lo tolera) el efecto malo que se seguirá de la acción.</div><div>La acción debe ser en sí buena o indiferente, pues no sería correcto emprender un acto en sí malo (por ejemplo, robar) para conseguir un fin bueno (curar una gripe ordinaria).</div><div>Debe existir una razón proporcionalmente grave para aceptar el acto. Es decir, el beneficio que se espera obtener debe ser lo suficientemente serio como para justificar la puesta en marcha de una acción que traerá alguna consecuencia negativa (y menos negativa que el resultado bueno que se espera conseguir).</div></div>', 1),
(193, 74, 'False', 2, '0.0000000', 'Incorrecto. La excepción es el principio de doble efecto (dos efectos uno bueno y el otro malo). En el cual la acción del acto que genera un efecto malo también genera un efecto bueno y las reglas para ejecutarlos son:<div>El objeto del acto que se persigue debe ser bueno.<div>La intención del que actúa debe ser buena y excluye (no desea, pero lo tolera) el efecto malo que se seguirá de la acción.</div><div>La acción debe ser en sí buena o indiferente, pues no sería correcto emprender un acto en sí malo (por ejemplo, robar) para conseguir un fin bueno (curar una gripe ordinaria).</div><div>Debe existir una razón proporcionalmente grave para aceptar el acto. Es decir, el beneficio que se espera obtener debe ser lo suficientemente serio como para justificar la puesta en marcha de una acción que traerá alguna consecuencia negativa (y menos negativa que el resultado bueno que se espera conseguir).</div></div>', 1),
