INSERT INTO `mdl_question_attempts` (`id`, `questionusageid`, `slot`, `behaviour`, `questionid`, `variant`, `maxmark`, `minfraction`, `flagged`, `questionsummary`, `rightanswer`, `responsesummary`, `timemodified`) VALUES
(1, 6, 1, 'adaptive', 3, 1, '1.0000000', '0.0000000', 0, 'La Fenomenología, es un método cuyo punto de partida es la observación del hecho que se muestra al sujeto, cuya finalidad es interpretar lo que se muestra, lo dado en la experiencia.', 'True', 'True', 1376895026),
(2, 6, 2, 'adaptive', 2, 1, '1.0000000', '0.0000000', 0, 'El termino «fenómeno» (según Hegel) es la fase descriptiva centrada en la esfera aparencial del objeto en cuestión', 'True', 'True', 1376894824),
(3, 6, 3, 'adaptive', 4, 1, '1.0000000', '0.0000000', 0, 'Se ha definido la fenomenología de la religión como saber descriptivo de la actitud atea.', 'False', 'False', 1376894602),
(4, 6, 4, 'adaptive', 5, 1, '1.0000000', '0.0000000', 0, 'Se puede entender la fenomenología de la religión como una ciencia que busca la comprensión del fenómeno religioso a partir de sus manifestaciones históricas tanto individuales como coletivas', 'True', 'True', 1376895026),
(5, 6, 5, 'adaptive', 6, 1, '1.0000000', '0.0000000', 0, 'Para la fenomenología de la religión, el objeto se identifica con lo sagrado y el sujeto es el hombre creyente.', 'True', 'True', 1376894777),
(6, 6, 6, 'adaptive', 7, 1, '1.0000000', '0.0000000', 0, 'Para la fenomenología de la religión, como ciencia, no se capta el objeto directamente, sino solo a través de la actividad específica del sujeto, cuyo sentido intenta descifrar.', 'True', 'True', 1376894692),
(7, 6, 7, 'adaptive', 8, 1, '1.0000000', '0.0000000', 0, 'En la mostración del fenómeno aparecen tres niveles distintos que corresponden a la vivencia, a la comprensión y al testimonio. ', 'True', 'True', 1376894793),
(8, 6, 8, 'adaptive', 9, 1, '1.0000000', '0.0000000', 0, 'El objetivo de la fenomenología de la religión  no es analizar las respuestas dadas por el hombre a la interpelación de lo sagrado, lo otro, asi como conocer la forma de vivir esta llamada', 'False', 'True', 1376894667),
(9, 6, 9, 'adaptive', 10, 1, '1.0000000', '0.0000000', 0, 'Para Leeuw el fenomenólogo de la religión determina su cometido indicando sus fines propios: 1) Describir los fenómenos y ponerles nombre (oración, sacrificio; rito, etcétera); 2) Insertar el hecho en la propia existencia vivenciándolo; 3) Contemplar lo mostrado; 4) Explicitar y aclarar su sentido; 5) Comprender lo manifestado.', 'True', 'True', 1376894709),
(10, 6, 10, 'adaptive', 11, 1, '1.0000000', '0.0000000', 0, 'Se puede definir la fenomenología de la religión como la ciencia que trata de la perceptibilidad inmediata de la esencia de la religión a través de sus manifestaciones (objetos, actos, doctrinas, instituciones, comportamientos y resultados). ', 'True', 'True', 1376894580),
(11, 6, 11, 'adaptive', 13, 1, '1.0000000', '0.0000000', 0, 'De múltiples maneras, en su historia, y hasta el día de hoy, los hombres han expresado a su búsqueda de Dios por medio de sus creencias y sus comportamientos religiosos (oraciones, sacrificios, cultos, meditaciones, etc.). A pesar de las ambigüedades que pueden entrañar, estas formas de expresión son tan particulares que no se puede llamar al hombre un ser religioso.', 'False', 'False', 1376894727),
(12, 6, 12, 'adaptive', 12, 1, '1.0000000', '0.0000000', 0, 'Para Chantepie de la Saussaye  la fenomenología de la religión se puede definir como la «ciencia que se propone el estudio de la religión, de su esencia y de sus manifestaciones».', 'True', 'True', 1376894765),
