(108, 71, 12, 'adaptive', 13, 1, '1.0000000', '0.0000000', 0, 'De múltiples maneras, en su historia, y hasta el día de hoy, los hombres han expresado a su búsqueda de Dios por medio de sus creencias y sus comportamientos religiosos (oraciones, sacrificios, cultos, meditaciones, etc.). A pesar de las ambigüedades que pueden entrañar, estas formas de expresión son tan particulares que no se puede llamar al hombre un ser religioso.', 'False', 'False', 1398193145),
(109, 16, 1, 'adaptive', 18, 1, '1.0000000', '0.0000000', 0, 'La historia de las religiones no  expresa juicios de valor acerca del status o mérito epistemológico o teológico de los fenómenos que son estudiados; sencillamente intenta comprender su significado.', 'True', 'True', 1377406463),
