(113, 16, 5, 'adaptive', 23, 1, '1.0000000', '0.0000000', 0, 'La historia de las religiones no se limita a la verificación y explicación analítica de datos religiosos aislados, según son estudiados aisladamente por las diversas disciplinas especializadas, como la filología, arqueología y etnología, que están relacionadas con la investigación histórica. Pretende coordinar los datos religiosos unos con otros establecer relaciones y agrupar los hechos según estas relaciones.', 'True', 'True', 1377406463),
