(264, 79, 6, 'adaptive', 54, 1, '1.0000000', '0.0000000', 0, '       La  TEODICEA , a diferencia de la TEOLOGÍA DE LA REVELACIÓN, conoce a Dios como autor de la revelación y fundamenta aquí la unidad de los contenidos de la fe, a los que se refiere con la razón iluminada por la fe.', 'False', '', 1400608221),
(265, 79, 7, 'adaptive', 55, 1, '1.0000000', '0.0000000', 0, 'El giro antropocéntrico efectuado por la filosofía contemporánea no tuvo  repercusiones en la definición del objeto formal de la teología.', 'False', '', 1400608221),
(266, 79, 8, 'adaptive', 56, 1, '1.0000000', '0.0000000', 0, 'Según Rahner: “La teología no es, en un sentido primero y originario, un sistema de sentencias validas construido por el pensamiento humano, sino la totalidad del discurso divino dirigido por Dios mismo —aunque en lenguaje humano— a los hombres”', 'True', '', 1400608221),
(267, 79, 9, 'adaptive', 57, 1, '1.0000000', '0.0000000', 0, 'Desde la Constitución pastoral del II concilio Vaticano, las encíclicas sobre los retos políticos y sociales mundiales, las conferencias episcopales latinoamericanas de Medellín, Puebla, Santo Domingo  se ha ido configurando un nuevo esquema de referencia, que afecta también a la definición del objeto formal de la teología.', 'True', '', 1400608221),
(268, 79, 10, 'adaptive', 58, 1, '1.0000000', '0.0000000', 0, 'Si por teología se entiende el esfuerzo científico en torno a una iluminación racional de la fe cristiana, de su realización en el curso de la historia y de su pretensión de validez eclesial y social, puede decirse que las especialidades sistemáticas configuran, con la dogmática, la teología moral y la teología fundamental, el «tronco científico» de la teología.', 'True', '', 1400608221),
(269, 58, 1, 'adaptive', 59, 1, '1.0000000', '0.0000000', 0, 'La Teología moral fundamental incluye todo lo relativo a las acciones libres del hombre y el último, o supremo, fin a alcanzarse a través de ellos, hasta donde lo conocemos por la misma divina revelación; en otras palabras, incluye el fin sobrenatural, la regla o norma, del orden moral, las acciones humanas como tales, su armonía o disonancia con las leyes del orden moral, sus consecuencias, las ayudas divinas para su recto cumplimiento.', 'True', 'True', 1381806475),
(270, 58, 2, 'adaptive', 60, 1, '1.0000000', '0.0000000', 0, 'Una manera de definir la LIBERTAD es  el poder, radicado en la razón y en la voluntad, de obrar o de no obrar, de hacer esto o aquello, de ejecutar así por sí mismo acciones deliberadas. ', 'True', 'True', 1381806475),
(271, 58, 3, 'adaptive', 61, 1, '1.0000000', '0.0000000', 0, 'Hay verdadera libertad cuando no se busca el bien ni la justicia', 'False', 'False', 1381806475),
(272, 58, 4, 'adaptive', 62, 1, '1.0000000', '0.0000000', 0, 'Acrecientan el dominio de la voluntad sobre los propios actos las siguientes opciones:', 'Todas las opciones mencionadas anteriormente', 'Todas las opciones mencionadas anteriormente', 1381806475),
(273, 58, 5, 'adaptive', 63, 1, '1.0000000', '0.0000000', 0, 'Para que el efecto malo de un acto voluntario sea imputable, es preciso:', 'Todas las opciones mencionadas anteriormente', 'Todas las opciones mencionadas anteriormente', 1381806475),
(274, 58, 6, 'adaptive', 64, 1, '1.0000000', '0.0000000', 0, 'La LEY es una regla de conducta proclamada por la autoridad competente para el bien común', 'True', 'True', 1381806475),
(275, 58, 7, 'adaptive', 65, 1, '1.0000000', '0.0000000', 0, 'La LEY NATURAL permanece como una norma que une entre sí a los hombres y les impone, por encima de las diferencias inevitables, principios comunes.', 'True', 'True', 1381806475),
(276, 58, 8, 'adaptive', 66, 1, '1.0000000', '0.0000000', 0, 'La ley natural es:', 'Todas las opciones mencionadas anteriormente', 'Todas las opciones mencionadas anteriormente', 1381806475),
