(352, 78, 4, 'adaptive', 62, 1, '1.0000000', '0.0000000', 0, 'Acrecientan el dominio de la voluntad sobre los propios actos las siguientes opciones:', 'Todas las opciones mencionadas anteriormente', 'Todas las opciones mencionadas anteriormente', 1400619500),
(353, 78, 5, 'adaptive', 63, 1, '1.0000000', '0.0000000', 0, 'Para que el efecto malo de un acto voluntario sea imputable, es preciso:', 'Todas las opciones mencionadas anteriormente', 'Todas las opciones mencionadas anteriormente', 1400619500),
(354, 78, 6, 'adaptive', 64, 1, '1.0000000', '0.0000000', 0, 'La LEY es una regla de conducta proclamada por la autoridad competente para el bien común', 'True', 'True', 1400619500),
(355, 78, 7, 'adaptive', 65, 1, '1.0000000', '0.0000000', 0, 'La LEY NATURAL permanece como una norma que une entre sí a los hombres y les impone, por encima de las diferencias inevitables, principios comunes.', 'True', 'True', 1400619500),
(356, 78, 8, 'adaptive', 66, 1, '1.0000000', '0.0000000', 0, 'La ley natural es:', 'Todas las opciones mencionadas anteriormente', 'Todas las opciones mencionadas anteriormente', 1400619500),
(357, 78, 9, 'adaptive', 67, 1, '1.0000000', '0.0000000', 0, 'Se le llama la Ley nueva o Ley evangélica a la perfección aquí  de la ley divina, natural y revelada.', 'True', 'True', 1400619500),
(358, 78, 10, 'adaptive', 68, 1, '1.0000000', '0.0000000', 0, 'La moralidad de los actos humanos depende de: ', 'Todas las opciones mencionadas anteriormente', 'Todas las opciones mencionadas anteriormente', 1400619500),
(359, 78, 11, 'adaptive', 69, 1, '1.0000000', '0.0000000', 0, 'El FIN DE LA ACCIÓN es el término primero de la intención y designa el objetivo buscado en la acción', 'True', 'True', 1400619500),
(360, 78, 12, 'adaptive', 70, 1, '1.0000000', '0.0000000', 0, '¿Es cierto que el FIN DE UNA ACCIÓN elegida no justifica los medios?', 'True', 'True', 1400619500),
(361, 78, 13, 'adaptive', 71, 1, '1.0000000', '0.0000000', 0, '¿Una intención mala sobreañadida (como la vanagloria) no convierte en malo un acto que, de suyo, puede ser bueno (como la limosna) ?', 'False', 'False', 1400619500),
(362, 78, 14, 'adaptive', 72, 1, '1.0000000', '0.0000000', 0, 'El acto moralmente bueno supone a la vez la bondad de:', 'Todas las opciones mencionadas anteriormente', 'Todas las opciones mencionadas anteriormente', 1400619500),
(363, 78, 15, 'adaptive', 73, 1, '1.0000000', '0.0000000', 0, 'No hay actos que, por sí y en sí mismos, independientemente de las circunstancias y de las intenciones, son siempre gravemente ilícitos por razón de su objeto.', 'False', 'False', 1400619500),
(364, 78, 16, 'adaptive', 74, 1, '1.0000000', '0.0000000', 0, 'No está permitido hacer el mal para obtener un bien.', 'True', 'True', 1400619500),
(365, 78, 17, 'adaptive', 75, 1, '1.0000000', '0.0000000', 0, 'La moralidad no puede ser juzgada si se prescinde de la conformidad u oposición de la elección deliberada de un comportamiento concreto respecto a la dignidad y a la vocación integral de la persona humana.', 'True', 'True', 1400619500),
(366, 78, 18, 'adaptive', 76, 1, '1.0000000', '0.0000000', 0, 'Los preceptos morales negativos, es decir, los que prohiben algunos actos o comportamientos concretos como intrínsecamente malos, no admiten ninguna excepción legítima.', 'True', 'True', 1400619500),
(367, 78, 19, 'adaptive', 77, 1, '1.0000000', '0.0000000', 0, 'El consecuencialismo  pretende obtener los criterios de la rectitud de un obrar determinado sólo del cálculo de las consecuencias que se prevé pueden derivarse de la ejecución de una decisión.', 'True', 'True', 1400619500),
(368, 78, 20, 'adaptive', 78, 1, '1.0000000', '0.0000000', 0, 'El consecuencialismo y el proporcionalismo  no son fieles a la doctrina de la Iglesia Católica, en cuanto creen poder justificar, como moralmente buenas, elecciones deliberadas de comportamientos contrarios a los mandamientos de la ley divina y natural.', 'True', 'True', 1400619500),
(369, 62, 1, 'adaptive', 79, 1, '1.0000000', '0.0000000', 0, 'Es cierto que de acuerdo a la Teología Católica, ¿Dios no cesa de atraer a la persona hacia sí, para que viva y encuentre en Él aquella plenitud de verdad y felicidad a la que aspira sin descanso? (Cf. CEC 27-30; 44-45)', 'True', 'True', 1382419147),
