(401, 44, 3, 'adaptive', 92, 1, '1.0000000', '0.0000000', 0, 'Se dice que éste Evangelio fue escrito alrededor del año 70 y que sus destinatarios son cristianos paganos, por eso tiene que explicar costumbres judías y palabras arameas.', 'Evangelio según san Marcos', 'Evangelio según san Marcos', 1380404118),
(402, 44, 4, 'adaptive', 93, 1, '1.0000000', '0.0000000', 0, 'Se dice que este Evangelio fue escrito después de los años 80, sus destinatarios son principalmente judeocristianos pero separados del judaísmo y que hace de puente entre el Antiguo y el Nuevo Testamento. ', 'Evangelio según san Mateo', 'Evangelio según san Mateo', 1380404118),
(403, 44, 5, 'adaptive', 94, 1, '1.0000000', '0.0000000', 0, 'Éste evangelio nos presenta 4 grandes discursos:1) El discurso del Monte  (cap. 5,1 al cap. 7,29)2) El discurso de los enviados (cap. 10, 1-42)3) El discruso contra los falsos dirigentes (cap. 23, 1-39)4) El discruso acerca del fin del mundo (cap. 24,1 al cap 25,46)', 'Evangelio según San Mateo', 'Evangelio según San Mateo', 1380404118),
(404, 44, 6, 'adaptive', 95, 1, '1.0000000', '0.0000000', 0, 'Éste evangelio fue escrito alrededor del año 85, sus destinatarios son mayoritariamente cristianos griegos y el evangelista les escribe para confirmarlos, como lo dice en el inicio del su Evangelio.', 'Evangelio según San Lucas', 'Evangelio según San Lucas', 1380404118),
(405, 44, 7, 'adaptive', 97, 1, '1.0000000', '0.0000000', 0, 'Este Evangelio se terminó de escribir alrededor del año 95. Y la comunidad a la que escribe está formada por judíos, samaritanos y paganos convertidos a la fe en Jesús.', 'Evangelio según San Juan', 'Evangelio según San Juan', 1380404118),
(406, 44, 8, 'adaptive', 91, 1, '1.0000000', '0.0000000', 0, ' ¿Es cierto que a los evangelios según San Marcos, San Mateo y San Lucas se les llama Evangelios sinópticos porque los tres siguen una estructura similar, presentan el mismo cuadro de hechos y espacios geográficos por donde anduvo Jesús?', 'True', 'True', 1380404118),
