(500, 67, 2, 'adaptive', 104, 1, '1.0000000', '0.0000000', 0, 'Para este autor, en su obra escrita llamada "Theology in the age of science" procura llegar a una comprensión de lo natural y de lo divino con las categorías construidas desde las ciencias naturales.', 'Arthur Peacocke (físico y teólogo)', 'Arthur Peacocke (físico y teólogo)', 1393058297),
(501, 67, 3, 'adaptive', 105, 1, '1.0000000', '0.0000000', 0, 'Para este autor, una posibilidad del diálogo entre la Teología y las ciencias es pasar de categorías esencialistas hacia categorías personalistas, ya que los varios saberes contribuyen a la autocomprensión del sujeto y a la determinación de sus elecciones existenciales, incluida la religiosa. ', 'Giuseppe Tanella-Nitti', 'Giuseppe Tanella-Nitti', 1393058297),
(502, 67, 4, 'adaptive', 106, 1, '1.0000000', '0.0000000', 0, 'Para Giuseppe Tanella-Nitti (radioastrónomo y teólogo católico) se ha producido una progresiva recepción de la visión contemporánea sobre el cosmos físico, sobre la vida y sobre la especie humana como horizonte contextual irrenunciable para una mejor comprensión de la doctrina bíblica sobre la creación y de la misma historia de la salvación.(cfr. "Del diálogo a la ingegración intelectual: algunas premisas epistemológicas").', 'Giuseppe Tanella-Nitti', 'Giuseppe Tanella-Nitti', 1393058297),
(503, 67, 5, 'adaptive', 107, 1, '1.0000000', '0.0000000', 0, 'Para éste autor, la utilización de dos nociones merecería una atención particular: la de trascendencia y la de experiencia. En el empleo de la primera, crucial para todo el discurso teológico, se debería saber mostrare su conexión con el análisis de las ciencias y con sus relativas aperturas epistemológicas y antropológicas; en el empleo de la segunda, crucial para todo el discurso científico, se debería saber explicar en qué modo la experiencia de las cosas de Dios y la experiencia de las ciencias entrecruzan la esfera del mundo sensible y de la historia.   ', 'Giuseppe Tanella-Nitti', 'Giuseppe Tanella-Nitti', 1393058297),
(504, 67, 6, 'adaptive', 99, 1, '1.0000000', '0.0000000', 0, '¿Es cierto que la aparición de disciplinas abocadas al fenómeno religioso como tal (Ciencias de la Religión, Historia de las Religiones, Religiones Comparadas, Psicología de la Religión, Sociología de la Religión, etc.) ha colaborado a focalizar más analítica y ampliamente el hecho religioso en su multitud de expresiones?', 'True', 'True', 1393058297),
(505, 67, 7, 'adaptive', 100, 1, '1.0000000', '0.0000000', 0, '¿Es cierto que la ciencia se construye como una elaboración crítica de la experiencia sobre el mundo, utilizando una experimentación controlada y matematizada y un afinado conjunto de métodos?', 'True', 'True', 1393058297),
(506, 67, 8, 'adaptive', 101, 1, '1.0000000', '0.0000000', 0, '¿Es cierto que la Teología ha sido caracterizada históricamente como una aplicación de la racionalidad humana sobre el dato objetivo de la revelación divina?', 'True', 'True', 1393058297),
(507, 67, 9, 'adaptive', 102, 1, '1.0000000', '0.0000000', 0, '¿Es cierto que la Teología católica ha sido elaborada durante muchos siglos antes de plantearse críticamente su estatuto epistemológico y los criterios de confección de la misma.?', 'True', 'True', 1393058297),
(508, 67, 10, 'adaptive', 103, 1, '1.0000000', '0.0000000', 0, '¿Se podría afirmar que la asociación entre Teología y Ciencia es responsabilidad de la escolástica medieval?', 'True', 'True', 1393058297),
(509, 82, 1, 'adaptive', 108, 1, '1.0000000', '0.0000000', 0, 'Para éste autor, la Revelación que nos instruye, debería ser hecha en base a la perspectiva científica, con consecuentes posibles implicaciones para la escatología, tratándose de implicaciones y no necesariamente de problematizaciones, por tanto, de exigencias de inteligibilidad para una mejor comprensión dogmática de la Revelación misma.', 'Giuseppe Tanella-Nitti', 'Giuseppe Tanella-Nitti', 1401575924);
