(1, 2, 'Introduccion y Circulos Armonicos', 'html', '', '', 0, '<div><img src="https://fbcdn-sphotos-c-a.akamaihd.net/hphotos-ak-frc1/s720x720/428877_509597562391083_1827618569_n.jpg" alt="Francisco Castañeda" title="Francisco Castañeda" border="0" hspace="0" vspace="0" /><br /></div><div><br /></div>Hola y Bienvenidos<div><br /></div><div>Los armonía es la base de la música. Funciona como el agua para los peces: si no esta presente, no vive la música. Los círculos armónicos son la formula básica de realizar un enunciado musical. Se conforman de 4 acordes que se repiten de manera constante hasta terminar en el primer acorde.</div><div><br /></div>', '', '', 1375955427, 1, 2, 'page', 1, 1408524413),
(2, 2, 'Ritmos para circulos', 'html', '', '<i>Tener </i>una variedad de <b>ritmos base</b> para utilizar en los círculos armónicos para agregar otro de los <b>elementos base </b>de la música.\r\n', 0, 'Saludos!<div><br /></div><div><br /></div><div><br /></div><div>Los ritmos base son:</div><div><img src="http://cienciayfetijuana.com/file.php/2/blues-en-g.jpg" alt="Blues en Sol" title="Blues en Sol" border="0" hspace="0" vspace="0" width="700" height="334" /><br /></div><div><br /></div><div>Segundo Ritmo:</div><div><img src="http://cienciayfetijuana.com/file.php/2/2do-ritmo.jpg" alt="Segundo Ritmo" title="Segundo Ritmo" border="0" hspace="0" vspace="0" width="615" height="212" /><br /></div>', '', '', 1371946285, 2, 3, 'page', 2, 1408524413),
(3, 3, 'Lección 1. Introducción', 'html', '', 'En esta lección estudiarás los primeros 6 siglos del cristianismo católico. \r\n', 0, '<div data-configid="3842813/3203242" style="width: 525px; height: 525px;" class="issuuembed"><div style="width: 100%; height: 100%;">    <div style="height: calc(100% - 18px);"><object style="width: 100%; height: 100%;"><param name="movie" value="http://static.issuu.com/webembed/viewers/style1/v2/IssuuReader.swf?mode=mini&jsAPIClientDomain=cienciayfetijuana.com&jsAPIInitCallback=issuuflashEmbedOnInit01385552529245615&bl_referrer=http%3A%2F%2Fcienciayfetijuana.com%2Fcourse%2Fmodedit.php%3Fupdate%3D6%26return%3D1&documentId=130609160014-b8c73ce07a6976aa58e023ef5f571777&embedId=3842813/3203242" /><param name="allowfullscreen" value="true" /><param name="allowscriptaccess" value="always" /><param name="menu" value="false" /><param name="wmode" value="transparent" /><embed src="http://static.issuu.com/webembed/viewers/style1/v2/IssuuReader.swf" type="application/x-shockwave-flash" allowfullscreen="true" allowscriptaccess="always" menu="false" wmode="transparent" style="width: 100%; height: 100%;" flashvars="mode=mini&jsAPIClientDomain=cienciayfetijuana.com&jsAPIInitCallback=issuuflashEmbedOnInit01385552529245615&bl_referrer=http%3A%2F%2Fcienciayfetijuana.com%2Fcourse%2Fmodedit.php%3Fupdate%3D6%26return%3D1&documentId=130609160014-b8c73ce07a6976aa58e023ef5f571777&embedId=3842813/3203242" /></object></div>    <div style="height: 18px; text-align: left;">        <span style="width: 100%; text-align: left; font-family: ''helvetica neue'', helvetica, arial, sans-serif; font-size: 12px; font-style: normal; font-weight: normal; height: auto; line-height: 18px; margin: 0px; padding: 0px;">            <a href="http://issuu.com/sergioc/docs/01_introduccion" target="_blank">Open publication</a> - Free <a href="http://issuu.com" target="_blank">publishing</a>        </span> </div></div></div><script type="text/javascript" src="http://e.issuu.com/embed.js" async="true"></script>', '', '', 1371182902, 3, 6, 'page', 3, 1408524413),
(4, 3, 'Lección 2. Conocimientos previos', 'html', '', 'En esta lección el alumno aprenderá a tomar en cuenta varios aspectos de la Historia de la Iglesia como sede de la providencia de Dios y el obrar humano.\r\n\r\n', 0, '<iframe width="525" height="372" src="http://e.issuu.com/embed.html#3842813/3413860" frameborder="0"></iframe>', '', '', 1371183076, 4, 7, 'page', 4, 1408524413),
