(6, 3, 'Lección 3. División de la Historia de la Iglesia', 'html', '', 'En esta lección el alumno aprenderá diversas maneras de dividir la Historia de la Iglesia.\r\n\r\n\r\n\r\n', 0, '<iframe width="525" height="371" src="http://e.issuu.com/embed.html#3842813/3414640" frameborder="0"></iframe>', '', '', 1371941719, 6, 9, 'page', 6, 1408524413),
(7, 3, 'Las pruebas científicas del éxodo', 'html', '', 'Documentales científicos que narran el éxodo bíblico como hecho histórico.\r\n\r\n\r\n', 0, '<iframe width="560" height="315" src="https://www.youtube.com/embed/fXDOee0x3Nk" frameborder="0"></iframe>  <iframe width="560" height="315" src="https://www.youtube.com/embed/Q_iIp17uWzo" frameborder="0"></iframe>', '', '', 1371944192, 11, 14, 'page', 7, 1408524413),
(8, 4, 'Generalidades', 'file', 'http://www.aulafacil.com/Arabe/Lecciones/Lecc-0.htm', 'Aquí estudiarás algunas generalidades del lenguaje árabe.', 0, '', '', '', 1371945140, 12, 16, 'url', 1, 1408524418),
(9, 3, 'Lección 4. Nacimiento y expansión de la Iglesia Católica', 'html', '', 'En esta sección encontraremos los principales acontecimientos históricos que condujeron a la expansión y consolidación de la Iglesia católica así como los santos Padres latinos y griegos que consolidaron comunidades católicas en los primeros siglos. \r\n\r\n\r\n\r\n', 0, '<iframe width="525" height="372" src="//e.issuu.com/embed.html#3842813/3685516" frameborder="0"></iframe>', '', '', 1371944039, 8, 11, 'page', 8, 1408524413),
(10, 3, 'Lección 5. Los Concilios Ecuménicos', 'html', '', '<span style="font-family: ''trebuchet ms'', arial, helvetica, sans-serif; font-size: 13px; text-align: justify;">Cuando el Papa quiere tomar una decisión que abarca a toda la cristiandad - proclamar un dogma, modificar la organización de la Iglesia o condenar una herejía -, puede convocar un Concilio Ecuménico. </span><br style="font-family: ''trebuchet ms'', arial, helvetica, sans-serif; font-size: 13px; text-align: justify;" /><span style="font-family: ''trebuchet ms'', arial, helvetica, sans-serif; font-size: 13px; text-align: justify;">Los obispos del mundo entero son llamados a Roma (o a la ciudad que el Pontífice haya escogido). Su presencia es obligatoria, salvo en caso de fuerza mayor. Los superiores de órdenes religiosas, los abades generales, los prelados nullius ( es decir, que no tienen jurisdicción en una diócesis propiamente dicha) y los cardenales son admitidos a participar en el Concilio o Sínodo ecuménico. Tienen voz deliberativa. En esta lección se analizarán los Concilios Ecuménicos.</span>', 0, '<iframe width="525" height="372" src="//e.issuu.com/embed.html#3842813/3685561" frameborder="0"></iframe>', '', '', 1371943927, 9, 12, 'page', 9, 1408524413),
(11, 3, 'Lección 6. Las misiones de San Pablo', 'html', '', 'En esta lección analizaremos la conversión de San Pablo y sus misiones evangelizadoras.', 0, '<iframe width="420" height="315" src="https://www.youtube.com/embed/a0HirrKPGJQ" frameborder="0"></iframe> \r\n<iframe width="420" height="315" src="https://www.youtube.com/embed/a-h2WvOnX4g" frameborder="0"></iframe> \r\n<iframe width="420" height="315" src="https://www.youtube.com/embed/pF_3QyKlN8Q" frameborder="0"></iframe> \r\n<iframe width="420" height="315" src="https://www.youtube.com/embed/IEHTDlCjgMc" frameborder="0"></iframe> \r\n<iframe width="420" height="315" src="https://www.youtube.com/embed/s1qkeIqXev8" frameborder="0"></iframe> \r\n<iframe width="420" height="315" src="https://www.youtube.com/embed/9gEnX-OHPcc" frameborder="0"></iframe> \r\n<iframe width="420" height="315" src="https://www.youtube.com/embed/kJ124n9xlRE" frameborder="0"></iframe> \r\n<iframe width="420" height="315" src="https://www.youtube.com/embed/qwY6CiaN8tk" frameborder="0"></iframe>', '', '', 1371942787, 10, 13, 'page', 10, 1408524413),
