(23, 5, 'Explicación del curso Ciencia y Fe', 'text', '0', '<img src="https://fbcdn-sphotos-d-a.akamaihd.net/hphotos-ak-frc3/3368_489484274426638_51446442_n.jpg" alt="Instituto Domus Christi" title="Instituto Domus Christi" border="0" hspace="0" vspace="0" />\r\n', 0, 'CENTRO DE ESTUDIOS DE CIENCIA Y RELIGION\r\nINSTITUTO DOMUS CHRISTI\r\n\r\n\r\nPresentación \r\nCada vez, con mayor frecuencia, se presenta la articulación científica dada entre Ciencia y Religión. Por una parte se observa el desarrollo incesante de las ciencias y las tecnologías, las cuales suscitan nuevas y urgentes cuestiones éticas y antropológicas; por la otra parte, se llega al llamado pluralismo cultural y religioso, que lleva a la necesidad de proponer puntos de encuentro dirigidos al diálogo y a la  búsqueda en común de la verdad.      \r\nPor lo tanto, el diplomado en Ciencia y Religión aspira a ofrecer a los alumnos una visión sistémica del misterio de la salvación, junto con el conocimiento específico de las materias filosóficas, psicológicas, bioéticas y teológicas para afrontar dicho diálogo interdisciplinar.\r\n       \r\nObjetivos\r\n•	Profundizar la competencia teórica y cultural en la relación entre ciencia y religión.\r\n•	Hacer frente a la cuestión fundamental entre ciencia y religión, así como a las realidades de las áreas de bioética, desarrollo humano y  espiritualidad.\r\n•	Preparar en el área de ciencia y religión a sacerdotes, religiosos, religiosas y laicos comprometidos, para que puedan afrontar con mayores herramientas la realidad actual del católico en este diálogo interdisciplinar.    \r\n\r\nDirigido a:\r\n•	Hombres y mujeres religiosos que ejercen en la pastoral diferentes responsabilidades.\r\n•	Los trabajadores religiosos dentro de las asociaciones culturales cristianas.\r\n•	Todos los profesionales que, por razones de trabajo, tienen que articular el diálogo científico entre religión y cuestionamientos éticos.\r\n•	Expertos en el diseño de actividades interdisciplinarias de enseñanza.\r\n•	Los expertos en cuestiones culturales, religiosas y políticas que articulan ciencia y fe, incluyendo organismos internacionales y organizaciones no gubernamentales.\r\n\r\n\r\nModalidad del diplomado:\r\nEl diplomado con reconocimiento del TBC (http://www.tbc.mx/) se ofrece en modalidad e-learning. Las tutorías se programan entre semana y se realizan vía skype así como la revisión de exámenes. Como requisitos se debe contar con los siguientes requisitos:\r\n•	Computadora (Apple o IBM compatible, Tableta, etc.).\r\n•	Conexión a Internet.\r\n•	OS (Windows, Mac OS)\r\n•	Los siguientes programas instalados: \r\nSkype(Descarga gratis: http://www.skype.com/es/download-skype/skype-for-windows/downloading/)\r\nooVoo (Descarga gratis: http://www.oovoo.com/home.aspx )\r\nExplorador (chrome, IE, Firefox, etc), \r\nJava(Descarga gratis: http://www.java.com/es/download/index.jsp. )\r\n•	Micrófono\r\n•	Video cámara para computadora (opcional)\r\n\r\nPlan de Estudios:\r\nEl diplomado consta de 1 año de estudio, integrado con materias de tronco común sobre disciplinas científicas y religiosas; habilitando al estudiante a profundizar en la Maestría de Ciencias y Religión cuyos campos de especialización son las siguientes áreas: Bioética, Desarrollo Humano o Espiritualidad.  \r\n\r\nDiplomado en Ciencia y Fe\r\n\r\nI. Módulo de Religión (25 créditos)\r\n\r\nFenomenología de la Religión\r\nHistoria de las Religiones\r\nTeología Fundamental\r\nMoral Fundamental\r\nFundamentos de la Religión Católica\r\n\r\nII. Módulo de Ciencias Humanas (25 créditos)\r\n\r\nHistoria de la Ciencia y sus relaciones con la Filosofía y la Religión\r\nMetodología de investigación para las ciencias experimentales\r\nIntroducción a la Física\r\nIntroducción a la Cosmología\r\nIntroducción a la Antropología\r\n\r\nIII. Módulo de Desarrollo Humano (25 créditos)\r\n\r\nIntroducción a la Psicología\r\nTeorías de la personalidad\r\nDesarrollo Infantil\r\nDesarrollo de los adolescentes\r\nDesarrollo Adulto\r\n\r\nIV. Módulo de Bioética (25 créditos)\r\n\r\nEl estudio de la Bioética\r\nFundamentos éticos\r\nBiotecnología y Biomedicina\r\nCasos prácticos I\r\nCasos prácticos II\r\n\r\nV. Módulo de Espiritualidad (25 créditos)\r\n\r\nHistoria de la Espiritualidad Católica\r\nEspiritualidad Teológica\r\nPsicología y Espiritualidad\r\nPrácticas de oración\r\nFenomenología parapsicológica\r\n\r\nVI. Módulo de Teología Católica (25 créditos)\r\n\r\nIntroducción a las Sagradas Escrituras\r\nCristología\r\nSoteriología\r\nEclesiología\r\nEscatología\r\n\r\n\r\n\r\n\r\nPrograma de Maestría en Ciencias Religiosas\r\n\r\nProporciona a los futuros estudiantes las bases de fondo para perseguir la teología a nivel de posgrado en una Universidad Pontificia. Este programa coincide con los requisitos del ''Programa de Formación Sacerdotal. Proporciona una sólida educación de artes liberales, una apreciación profunda de la tradición intelectual católica, en el contexto histórico y cultural de la fe católica. Requiere un título de licenciatura.\r\nWebsite: http://www.domuni.es/ciencias-religiosas/informaciones-generales\r\n\r\nDuración del diplomado:\r\n\r\nEl total del diplomado son 30 semanas efectivas de clases 2 horas de instrucción por semana con instructor (via ooVoo/skype) y 3 horas de lectura personal, dando un total de 180 horas de horas clase. Cada módulo se cursa en 6 semanas realizándose de manera periódica la lectura y evaluación de los contenidos señalados. El estudiante será auxiliado en línea con 2 horas de tutoría semanal que se programarán al principio del módulo y podrá completar el curso satisfactoriamente obteniendo una calificación mínima de 8.0 sobre el contenido de las evaluaciones semanales. Se recomienda que el estudiante realice las evaluaciones semanales antes de las fechas establecidas pero en su caso se contabilizarán al final del curso programado las evaluaciones realizadas para dar un voto de A (aprobado) o NA (No aprobado) en su promedio general del módulo teniendo que aprobar todos los módulos para que se le de reconocimiento de la Institución educativa.\r\n\r\n\r\n\r\nCostos y para pedir mayor información:\r\nEl costo del mes es de 500 pesos que se deberá pagar en la primera quincena del mes para habilitar los contenidos del mes correspondiente.\r\nPara el movimiento FEF existe un descuento de 20% en el pago del mes.\r\nPara mayor información dirigirse a los sigs. teléfonos en Tijuana:\r\ncel: +(664) 694-15-79\r\nfijo: +(664) 104-40-07\r\n\r\n\r\nY escribiendo al \r\nemail: ast.tijuana@gmail.com\r\nFacebooks: Alianza Santa Teresa,\r\n           Grupo Domus Christi', 'resizable=1,scrollbars=1,directories=1,location=1,menubar=1,toolbar=1,status=1,width=620,height=450', '', 1401346868, 24, 30, 'page', 33, 1408524413),
(24, 5, 'Fenomenología de la Religión', 'html', '', '<span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">Se puede definir la\r\nfenomenología de la religión como </span><span style="font-size: 14pt; line-height: 115%; font-family: cambria, serif;">la ciencia que trata de la\r\nperceptibilidad inmediata de la esencia de la religión a través de sus\r\nmanifestaciones (objetos, actos, doctrinas, instituciones, comportamientos y\r\nresultados). </span>', 0, '<iframe width="525" height="1050" src="//e.issuu.com/embed.html#3842813/4375025" frameborder="0"></iframe>', '', '', 1377215541, 25, 31, 'page', 11, 1408524413),
