(28, 5, 'Historia de las Religiones', 'html', '', 'La <b>historia de las religiones</b> no  expresa juicios de valor acerca del status o mérito epistemológico o teológico de los fenómenos que son estudiados; sencillamente intenta comprender su significado.\r\n\r\n\r\n', 0, '<div data-configid="3842813/4560354" style="width: 400px; height: 400px;" class="issuuembed issuu-isrendered"><object id="issuu_08562454907223582" style="width: 100%; height: 100%;" type="application/x-shockwave-flash" data="http://static.issuu.com/webembed/viewers/style1/v2/IssuuReader.swf"><param name="movie" value="http://static.issuu.com/webembed/viewers/style1/v2/IssuuReader.swf" /><param name="flashvars" value="mode=mini&jsAPIClientDomain=cienciayfetijuana.com&jsAPIInitCallback=issuuflashEmbedOnInit6805710934568197&bl_referrer=http%3A%2F%2Fcienciayfetijuana.com%2Fcourse%2Fmodedit.php%3Fupdate%3D39%26return%3D1&shareMenuEnabled=false&backgroundImage=&backgroundStretch=true&layout=&documentId=130822235629-2350930ea74daa6895bcc3a8744ddcdd&embedId=3842813/4560354" /><param name="allowfullscreen" value="true" /><param name="allowscriptaccess" value="always" /><param name="menu" value="false" /><param name="wmode" value="transparent" /></object></div><script type="text/javascript" src="//e.issuu.com/embed.js" async="true"></script>', '', '', 1392446000, 29, 39, 'page', 15, 1408524413),
