INSERT INTO `mdl_role` (`id`, `name`, `shortname`, `description`, `sortorder`, `archetype`) VALUES
(1, 'Manager', 'manager', 'Managers can access course and modify them, they usually do not participate in courses.', 0, 'manager'),
(2, 'Course creator', 'coursecreator', 'Course creators can create new courses.', 1, 'coursecreator'),
(3, 'Teacher', 'editingteacher', 'Teachers can do anything within a course, including changing the activities and grading students.', 2, 'editingteacher'),
(4, 'Non-editing teacher', 'teacher', 'Non-editing teachers can teach in courses and grade students, but may not alter activities.', 3, 'teacher'),
(5, 'Student', 'student', 'Students generally have fewer privileges within a course.', 4, 'student'),
(6, 'Guest', 'guest', 'Guests have minimal privileges and usually can not enter text anywhere.', 5, 'guest'),
(7, 'Authenticated user', 'user', 'All logged in users.', 6, 'user'),
(8, 'Local Site Admin', 'local_admin', 'Administrate the site and have almost complete control over settings, students and courses. ', 7, 'manager');
